	(7, 6, '2015-08-31', '1', '2015-09-18 00:10:00', '2015-09-18 13:25:00', 5, 'teacher', '教练', NULL, NULL, NULL, NULL, 'q', 1, '教学课程', NULL, NULL, 16, '333', NULL, '2015-09-01', '7', '男', NULL, NULL, 'A1', NULL),
	(8, 10, '2015-10-08', '体验1', '2015-10-07 09:00:00', '2015-10-07 09:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '测试1', 1, '教学课程', NULL, NULL, 27, '测试1', NULL, '2014-02-04', '测试1', '男', '无', NULL, 'A1', NULL),
	(9, 11, '2015-10-11', 'A2', '2015-10-11 09:30:00', '2015-10-11 10:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '社交能力— 一个人上课无法评价。试水反应-- 一般，注意力还不集中。总体表现良好。', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(10, 10, '2015-10-07', 'A2', '2015-10-11 14:30:00', '2015-10-11 15:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '在水中游的很开心，试水反应也很不错。 带宝宝潜水了，效果也很好。这节课的总体表现很好。', 1, '教学课程', NULL, NULL, 31, '1005', NULL, '2015-03-30', '谌泓铭（洋洋）', '男', '广场附近', NULL, 'A2', NULL),
	(11, 14, '2015-10-14', 'A2', '2015-10-15 15:00:00', '2015-10-15 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小馒头基础能力不错，喜欢水，在水中非常活跃，试水反应不够好，注意力不够集中。', 1, '教学课程', NULL, NULL, 51, '1023', NULL, '2015-04-16', '周卓泰', '男', '南昌市顺外路', NULL, 'A2', NULL),
	(12, 15, '2015-10-14', 'B2', '2015-10-15 16:30:00', '2015-10-15 17:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小朋友一个人上课略感孤独，上了十来分钟才开始活跃。踢腿踢得挺好的，跳水敢于被动跳下到家长手中。试水反应做了一次就不愿继续。体力不错。', 1, '教学课程', NULL, NULL, 28, '016', NULL, '2013-07-06', '刘梁睿', '男', '红谷十二庭', NULL, 'B2', NULL),
	(13, 16, '2015-10-14', 'C1', '2015-10-15 17:00:00', '2015-10-15 17:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小朋友有些撒娇，试水反应做的很ok，初次敢于尝试把嘴巴没于水中吐泡泡。敢于自主的从岸边跳到爸爸的手上。', 1, '教学课程', NULL, NULL, 25, '005', NULL, '2011-02-05', '刘梁奕（Cathy)', '女', '南天阳光', NULL, 'C1', NULL),
	(14, 20, '2015-10-15', 'B1-B2', '2015-10-15 15:30:00', '2015-10-15 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小朋友很活跃，喜水，但是对试水反应很排斥，但是对试水的漏杯情有独钟。对于跳水非常的有兴趣。吐泡泡训练还没进展，需要加强。', 1, '教学课程', NULL, NULL, 35, '019', NULL, '2013-12-24', '袁晨硕(小满）', '男', '南昌世茂', NULL, 'B1', NULL),
	(15, 49, '2015-10-16', 'A2', '2015-10-16 09:30:00', '2015-10-16 10:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '宝宝试水反应还有待提高。注意力还不够集中。对场馆内的实物还是很好奇。需要继续熟悉。宝宝很活跃，开朗。', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(16, 37, '2015-10-16', 'A2', '2015-10-16 14:30:00', '2015-10-16 15:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '今天宝宝表现不怎么好，试水反应注意力没集中。仰漂让宝妈把动作调整了，但是宝宝可能一下不适应，跳水可以，最后宝妈说让孩子潜水，我跟宝妈说了宝宝今天试水不怎么好，最后没潜。', 1, '教学课程', NULL, NULL, 51, '1023', NULL, '2015-04-16', '周卓泰', '男', '南昌市顺外路', NULL, 'A2', NULL),
	(17, 55, '2015-10-18', 'A1', '2015-10-18 09:30:00', '2015-10-18 10:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '宝宝的各项反应都很好，试水反应不会闭眼睛，还需加强。', 1, '教学课程', NULL, NULL, 22, '003', NULL, '2015-04-19', '万子瑜小小', '男', '南昌红谷滩', NULL, 'A1', NULL),
	(18, 38, '2015-10-18', 'A2', '2015-10-18 15:00:00', '2015-10-18 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小馒头今天表现很好，没有以前好动，仰漂的时候很安静的躺在了妈妈的肩膀上。试水反应一般，做了一次潜水，没有喝水非常完美。', 1, '教学课程', NULL, NULL, 51, '1023', NULL, '2015-04-16', '周卓泰', '男', '南昌市顺外路', NULL, 'A2', NULL),
	(19, 39, '2015-10-21', 'A2', '2015-10-21 14:30:00', '2015-10-21 15:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小馒头今天一下水就哭，妈妈说他这两天都心情不好，经过欢迎歌及基本手法后，才笑逐颜开。宝宝现在终于学会躺在妈妈肩膀上享受仰漂。试水反应不错，听到realy 的的时候会主动闭眼睛。经过了两次潜水，表现很好。', 1, '教学课程', NULL, NULL, 51, '1023', NULL, '2015-04-16', '周卓泰', '男', '南昌市顺外路', NULL, 'A2', NULL),
	(20, 57, '2015-10-21', 'B2', '2015-10-22 13:30:00', '2015-10-22 14:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '宝宝在水中平衡性很好，活泼，比较喜水，试水反应一般，能够很好的听从口令，完成踢腿动作。', 1, '教学课程', NULL, NULL, 59, '1031', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市红谷滩名门世家', NULL, 'B2', NULL),
	(21, 59, '2015-10-22', '5岁8岁', '2015-10-24 17:00:00', '2015-10-24 18:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '两个都能潜水，军军表现太过活跃。琪琪很认真，学习能力比较快', 1, '教学课程', NULL, NULL, 122, '025', NULL, '2007-12-21', '刘彦军/刘子琪', '男', '海波澜庭', NULL, 'C1', NULL),
	(22, 65, '2015-10-20', 'A2', '2015-10-24 14:30:00', '2015-10-24 15:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '会踢水，但是试水反应还不专注，试过一次潜水效果不太理想，', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(23, 41, '2015-10-23', 'A2', '2015-10-24 14:30:00', '2015-10-24 15:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '在水中游的很开心，试水反应也很不错。 今天带宝宝潜了两次水，第一次是传递潜，第二次是妈妈自己带宝宝，潜效果也很好。这节课的总体表现很好。', 1, '教学课程', NULL, NULL, 51, '1023', NULL, '2015-04-16', '周卓泰', '男', '南昌市顺外路', NULL, 'A2', NULL),
	(24, 58, '2015-10-20', 'C1', '2015-10-24 17:00:00', '2015-10-24 17:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '性格比较内向，不愿意潜水，能够踢水。表现一般', 1, '教学课程', NULL, NULL, 23, '004', NULL, '2011-11-22', '程芷莹（Celia）', '女', '保利高尔夫花园', NULL, 'C1', NULL),
	(25, 58, '2015-10-20', 'C1', '2015-10-24 17:00:00', '2015-10-24 17:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '适应能力一般，不愿意与陌生人接触。整体表现一般', 1, '教学课程', NULL, NULL, 124, '1080', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
	(27, 26, '2015-10-22', 'A1', '2015-10-24 15:00:00', '2015-10-24 15:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '宝宝年龄小，只用摇篮法， 在水下没哭泣，用手浇水宝宝面部，也没反抗。没有闭嘴。', 1, '教学课程', NULL, NULL, 121, '1079', NULL, '2015-07-18', '刘安予', '女', '南昌八一桥', NULL, 'A1', NULL),
	(28, 61, '2015-10-22', 'A2', '2015-10-24 10:00:00', '2015-10-24 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '课堂比较活跃，试水反应会闭眼。会踢水。', 1, '教学课程', NULL, NULL, 112, '1072', NULL, '2014-12-30', '钟佩娜', '女', '南昌朝阳大桥', NULL, 'A2', NULL),
	(29, 61, '2015-10-22', 'A2', '2015-10-24 10:00:00', '2015-10-24 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '适应能力一般，不愿意与陌生人接触，不愿意做试水反应。', 1, '教学课程', NULL, NULL, 114, '1073', NULL, '2015-07-04', '李雯妤', '女', '南昌八一桥', NULL, 'A2', NULL),
