	(42, 35, '2015-10-24', 'C1', '2015-10-25 11:00:00', '2015-10-25 12:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '课堂状态很好，自由泳腿还有点弯曲，能够自主练习打腿。', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(43, 60, '2015-10-22', 'B2', '2015-10-25 11:00:00', '2015-10-25 11:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小满可能是因为一个人上课的原因，上课状态不是很活跃。惧怕试水反应，需要进一步的演示来让他进步。', 1, '教学课程', NULL, NULL, 35, '019', NULL, '2013-12-24', '袁晨硕(小满）', '男', '南昌世茂', NULL, 'B1', NULL),
