	(125, 139, '2015-11-13', NULL, '2015-11-13 10:30:00', '2015-11-13 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '潇潇今天表现很好，潜水两次，还是会有一点点的喝水反应。还需要多多督促宝宝在潜水的时候闭上嘴巴。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市红谷滩名门世家', NULL, 'B2', NULL),
	(126, 139, '2015-11-13', NULL, '2015-11-13 10:30:00', '2015-11-13 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '一一表现还是一般，全程难以有能让宝宝笑的环节，能把嘴巴没于水中。试水反应还是没有把眼睛闭上。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝一（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(128, 305, '2015-11-13', NULL, '2015-11-13 16:30:00', '2015-11-13 17:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '今天表现一般般。琪琪的腿还是有点不协调，还要继续努力。军军还是很调皮，自由泳手的动作还需要加强', 1, '教学课程', NULL, NULL, 122, '025', NULL, '2007-12-21', '刘彦军/刘子琪', '男', '海波澜庭', NULL, 'C1', NULL),
	(129, 171, '2015-11-13', NULL, '2015-11-13 17:40:00', '2015-11-13 18:40:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '圆圆今天的表现一般，试水反应还行，但是不愿意潜水。各方面的表现还算OK', 1, '教学课程', NULL, NULL, 20, '001', NULL, '2011-08-09', '李思源（圆圆）', '男', '滨江豪园', NULL, 'C1', NULL),
	(130, 171, '2015-11-13', NULL, '2015-11-13 17:40:00', '2015-11-13 18:40:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '一一的表现很棒，试水反应很好，可以潜水。跳水各方面都很好。', 1, '教学课程', NULL, NULL, 181, '1130', NULL, '2011-01-12', '黄一一', '女', '', NULL, 'C1', NULL),
	(131, 171, '2015-11-13', NULL, '2015-11-13 17:40:00', '2015-11-13 18:40:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '果果的腿踢的很棒，但是不愿意做试水反应。还要加油慢慢来', 1, '教学课程', NULL, NULL, 159, '024', NULL, '2012-04-29', '喻路丹（果果）', '女', '联发融德', NULL, 'C1', NULL),
	(132, 183, '2015-11-14', NULL, '2015-11-14 10:30:00', '2015-11-14 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '一一刚开始比较活跃，到了试水反应就抗拒了。蹬腿意识还可以，试水反应不错，但就是不愿做。跳水不错，很喜欢。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝一（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(133, 187, '2015-11-14', NULL, '2015-11-14 11:00:00', '2015-11-14 12:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '表现很好，进步很快。但是手上的动作还需要加强，缺少了点力量。总体来说不错', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(134, 310, '2015-11-14', 'C1', '2015-11-14 11:00:00', '2015-11-14 11:45:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '依依这节课表现不怎么好，上课不专心，踢腿意识还不够，试水反应还不错。潜水还是自己会捏住鼻子。跳水很好，能站立跳入水中。今天本来是说跳潜，但是没完成。', 1, '教学课程', NULL, NULL, 25, '005', NULL, '2011-02-05', '刘梁奕（Cathy)', '女', '南天阳光', NULL, 'C1', NULL),
	(135, 203, '2015-11-14', NULL, '2015-11-14 16:00:00', '2015-11-14 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬单子很大，很喜欢水，很勇敢，不会轻易的哭泣。对于以后的教学有很大的帮助，妈妈比较大胆，上课的时候要注意妈妈抱宝宝的手法，以免让宝宝呛水。', 1, '教学课程', NULL, NULL, 182, '1131', NULL, '2014-03-16', '黄昱彬（彬彬）', '女', '', NULL, 'B1', NULL),
	(136, 227, '2015-11-15', NULL, '2015-11-15 11:00:00', '2015-11-15 12:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '芷莹上课主要是在练习踢腿，其它的基本是完成不了， 吐泡泡，仰漂都做不了，爸爸对孩子也没有要求。', 1, '教学课程', NULL, NULL, 23, '004', NULL, '2011-11-22', '程芷莹（Celia）', '女', '保利高尔夫花园', NULL, 'C1', NULL),
	(137, 219, '2015-11-15', NULL, '2015-11-15 10:00:00', '2015-11-15 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '晓晓今天表现的非常棒，完成了一次传递潜。很有进步。', 1, '教学课程', NULL, NULL, 22, '003', NULL, '2015-04-19', '万子瑜小小', '男', '南昌红谷滩', NULL, 'A1', NULL),
	(138, 223, '2015-11-15', '', '2015-11-15 10:30:00', '2015-11-15 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '在水中游的很开心，试水反应也很不错。 带宝宝潜水了，效果也很好。这节课的总体表现很好。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市红谷滩名门世家', NULL, 'B2', NULL),
	(139, 223, '2015-11-15', '', '2015-11-15 10:30:00', '2015-11-15 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '刚开始比较沉稳，之后还可以，试水反应不好，会睁眼。跳水不错。', 1, '教学课程', NULL, NULL, 71, '029', NULL, '2013-11-07', '杜雅萱', '女', '南昌市', NULL, 'B1', NULL),
	(140, 223, '2015-11-15', '', '2015-11-15 10:30:00', '2015-11-15 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '可能环境的原因，一下水宝宝就哭了，上了20几分钟就上来了， 捡球环节不错，试水反应不行，但是爸爸带他潜水了，还行。跳水也不好，可能是哭闹原因，希望下次妈妈带下水，会有好的效果。', 1, '教学课程', NULL, NULL, 179, '1128', NULL, '2013-12-31', 'Mitch', '男', '', NULL, 'A1', NULL),
	(141, 311, '2015-11-15', 'C1', '2015-11-15 17:00:00', '2015-11-15 17:40:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '蹬腿意识很好，就是不愿做试水反应，但是做了。效果蛮好，跳水很好，能站立跳。', 1, '教学课程', NULL, NULL, 159, '024', NULL, '2012-04-29', '喻路丹（果果）', '女', '联发融德', NULL, 'C1', NULL),
	(142, 311, '2015-11-15', 'C1', '2015-11-15 17:00:00', '2015-11-15 17:40:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '宝宝第一次来，表现还可以。试水反应不错，跳水也还好。', 1, '教学课程', NULL, NULL, 183, '1131', NULL, '2012-06-04', '熊芷妤', '女', '', NULL, 'C1', NULL),
	(143, 311, '2015-11-15', 'C1', '2015-11-15 17:00:00', '2015-11-15 17:40:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '宝宝基础能力还好，试水反应不错，自己能吐泡泡，跳水也还可以。', 1, '教学课程', NULL, NULL, 184, '1132', NULL, '2012-09-05', '胡馨淉', '女', '', NULL, 'C1', NULL),
