	(145, 254, '2015-11-15', NULL, '2015-11-15 16:00:00', '2015-11-15 16:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '宝宝表现能力很好，试水反应不错，宝宝带了潜水，而且很好。跳水宝宝很喜欢。', 1, '教学课程', NULL, NULL, 175, '1125', NULL, '2013-12-31', '余梓睿', '男', '', NULL, 'B2', NULL),
