	(150, 275, '2015-11-18', NULL, '2015-11-18 10:30:00', '2015-11-18 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '一一今天表现很好，蹬腿意识可以，试水不喜欢，跳水能站立跳，跳水是最喜欢的，短潜一次,没有呛水，但是会哭。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝一（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
