	(152, 296, '2015-11-18', NULL, '2015-11-18 17:00:00', '2015-11-18 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '依依今天表现不是很好，非常的拒绝潜水，一直在强调不潜水。试水反应基本是没有任何压力的做完，就差潜水。', 1, '教学课程', NULL, NULL, 25, '005', NULL, '2011-02-05', '刘梁奕（Cathy)', '女', '南天阳光', NULL, 'C1', NULL),
	(153, 296, '2015-11-18', NULL, '2015-11-18 17:00:00', '2015-11-18 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬今天表现很好，踢腿都很主动的在踢，比以往表现好，但是还是非常的不愿意进行试水反应。期待下一次的表现。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
