	(156, 299, '2015-11-18', NULL, '2015-11-18 17:40:00', '2015-11-18 18:40:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '饺子今天上课纪律有点散漫，有点不听指挥。什么都不想做', 1, '教学课程', NULL, NULL, 177, '1127', NULL, '2013-01-01', '吴泊然', '男', '', NULL, 'C1', NULL),
	(157, 299, '2015-11-18', NULL, '2015-11-18 17:40:00', '2015-11-18 18:40:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '今天表现的还行，下水之前爸爸带她短潜了一下，进步很大。体力和胆量方面还需要多多鼓励和加强', 1, '教学课程', NULL, NULL, 23, '004', NULL, '2011-11-22', '程芷莹（Celia）', '女', '保利高尔夫花园', NULL, 'C1', NULL),
	(158, 287, '2015-11-18', '', '2015-11-18 15:30:00', '2015-11-18 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '宝宝四个月，对水一点都不惧怕，第一节课主要是用摇篮手法做了一些练习。试水反应不行，浇水的时候眼睛没有闭着的反射。', 1, '教学课程', NULL, NULL, 186, '1133', NULL, '2015-07-06', '程恩浩', '男', '', NULL, 'A1', NULL),
	(159, 100, '2015-11-19', NULL, '2015-11-19 10:30:00', '2015-11-19 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '萱萱今天的状态不好，注意力比较散漫，还是要其他的小朋友一起上课效果会好一点。', 1, '教学课程', NULL, NULL, 71, '029', NULL, '2013-11-07', '杜雅萱', '女', '南昌市', NULL, 'B1', NULL),
	(160, 128, '2015-11-19', '', '2015-11-19 17:00:00', '2015-11-19 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬这节课表现还好，能主动的 踢腿了。趴在爸爸的肩膀上踢，也仰着踢了。试水反应也只能是爸爸用手舀水浇一点点。吐泡泡能喝水到嘴里。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
	(161, 120, '2015-11-19', 'C1', '2015-11-19 16:00:00', '2015-11-19 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '佳乐表现很棒能深水潜水10秒，能由教练辅助水中探物。捡完玩具后还能对着相机摆poss。能借助浮板打腿游泳池一个单边。打腿还需要加强练习。', 1, '教学课程', NULL, NULL, 189, '031', NULL, '2013-11-13', '陈嘉乐', '男', '', NULL, 'B2', NULL),
	(162, 116, '2015-11-19', 'B1', '2015-11-19 15:30:00', '2015-11-19 16:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '宝宝的基础能力很好，蹬腿意识不错，试水反应还需努力，会张嘴巴，跳水很好，胆大能站立跳水。', 1, '教学课程', NULL, NULL, 189, '031', NULL, '2013-11-13', '陈嘉乐', '男', '', NULL, 'B2', NULL),
	(163, 96, '2015-11-19', 'B1', '2015-11-20 10:00:00', '2015-11-20 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '希希表现的还不错，但是课堂上还不怎么活跃，试水反应很好。', 1, '教学课程', NULL, NULL, 187, '1134', NULL, '2014-10-06', '詹晞晨（晞晞）', '男', '', NULL, 'B1', NULL),
	(164, 96, '2015-11-19', 'B1', '2015-11-20 10:00:00', '2015-11-20 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '晨晨表现的也不错，课堂比较活跃，试水反应很好。', 1, '教学课程', NULL, NULL, 188, '1135', NULL, '2014-10-06', '黄熹晨（晨晨）', '男', '南昌市', NULL, 'B1', NULL),
	(166, 140, '2015-11-20', NULL, '2015-11-20 10:30:00', '2015-11-20 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '潇潇依然很开心，开始不愿意潜水，后来变换潜水的办法就潜水了三次。座椅潜，钻圈圈潜。踢腿比较主动。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市红谷滩名门世家', NULL, 'B2', NULL),
