	(217, 276, '2015-11-25', NULL, '2015-11-25 10:30:00', '2015-11-25 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '姥爷带下水，小满今天表现不好，做什么都不愿意，上来之后也跟姥姥说了，希望她回去跟妈妈说下，还是妈妈带比较听话，姥爷带比较随性小满自己干嘛就干嘛。', 1, '教学课程', NULL, NULL, 35, '019', NULL, '2013-12-24', '袁晨硕(小满）', '男', '南昌世茂', NULL, 'B1', NULL),
	(218, 276, '2015-11-25', NULL, '2015-11-25 10:30:00', '2015-11-25 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，潇潇表现还好，就是有点难以控制，因为爸爸比较随潇潇自己来，蹬腿意识很好，试水还可以，跳水也不错，今天潜水了，效果也很好，和爸爸也一起潜了。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市红谷滩名门世家', NULL, 'B2', NULL),
	(219, 276, '2015-11-25', NULL, '2015-11-25 10:30:00', '2015-11-25 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，一好今天表现很好，蹬腿意识还需加强，试水很好，也能自己吐泡泡，跳水不错，带了潜水，效果也很好。', 1, '教学课程', NULL, NULL, 190, '1136', NULL, '2013-08-16', '王一好', '男', '红谷滩', NULL, 'B2', NULL),
	(223, 285, '2015-11-25', NULL, '2015-11-25 15:00:00', '2015-11-25 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '宝宝在水中基本没什么反应。做了一些基本的仰漂及摇篮手法，试水反应没有任何反应。妈妈下水非常的紧张。我着重强调小宝宝去外面游脖圈的危害。', 1, '教学课程', NULL, NULL, 205, '1149', NULL, '2015-10-10', '曹安安', '女', '', NULL, 'A1', NULL),
	(224, 313, '2015-11-25', 'A2', '2015-11-25 14:30:00', '2015-11-25 15:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，由于苗苗很久没来，一些动作都不会了，所以今天表现不怎么好，试水还是会张嘴巴。希望妈妈之后可以多些时间带他来。', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(225, 314, '2015-11-25', 'A2', '2015-11-25 15:00:00', '2015-11-25 15:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天子聪表现很好，蹬腿意识明显，试水也不错，也给他潜水了，会哭，但过会就好了。跳水的还可以，没有太大的意识。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(226, 300, '2015-11-25', NULL, '2015-11-25 17:40:00', '2015-11-25 18:40:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '今天都有进步，琪琪已经可以放板子打腿了，但是体力还是不行。军军可以游自由泳配合了，但是动作欠缺一点力量。都还要继续努力。', 1, '教学课程', NULL, NULL, 122, '025', NULL, '2007-12-21', '刘彦军/刘子琪', '男', '海波澜庭', NULL, 'C1', NULL),
	(234, 297, '2015-11-25', NULL, '2015-11-25 17:00:00', '2015-11-25 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '兜兜胆子非常的小。在岸上很久不敢下水。上了大概十五分钟才加入到课堂中来。后来还是玩的非常的开心。宝宝比较认生。', 1, '教学课程', NULL, NULL, 207, '1150', NULL, '2013-12-08', '万周乐窈（兜兜）', '女', '', NULL, 'B2', NULL),
	(235, 297, '2015-11-25', NULL, '2015-11-25 17:00:00', '2015-11-25 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '今天因为有很多小朋友上课，彬彬表现的很开心。爸爸下水很配合。缺点是宝宝还是喜欢大叫。别的家长有意见。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
	(236, 297, '2015-11-25', NULL, '2015-11-25 17:00:00', '2015-11-25 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '果果今天跳水了很多次。跳的一次比一次好。踢腿还是能非常主动的踢起来。', 1, '教学课程', NULL, NULL, 159, '024', NULL, '2012-04-29', '喻路丹（果果）', '女', '联发融德', NULL, 'C1', NULL),
	(237, 297, '2015-11-25', NULL, '2015-11-25 17:00:00', '2015-11-25 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '泊然有些任性，总是喜欢拿到一个玩具不撒手。胆子有点小。不敢跳水。试水反应还做的不是很好。爸爸比较随宝宝的意愿。', 1, '教学课程', NULL, NULL, 177, '1127', NULL, '2013-01-01', '吴泊然', '男', '', NULL, 'C1', NULL),
	(241, 101, '2015-11-26', NULL, '2015-11-26 10:30:00', '2015-11-26 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '萱萱的今天表现的不错，踢水踢得很好，试水反应能闭眼睛但是还有点抗拒。总体是很有进步的', 1, '教学课程', NULL, NULL, 71, '029', NULL, '2013-11-07', '杜雅萱', '女', '南昌市', NULL, 'B1', NULL),
	(242, 101, '2015-11-26', NULL, '2015-11-26 10:30:00', '2015-11-26 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '萱萱今天上课表现很活跃，还不会踢水，但是试水反应很好下节课可以做短潜。跳水一般，', 1, '教学课程', NULL, NULL, 131, '1086', NULL, '2014-11-18', '袁梓萱', '女', '南昌市洪都大道', NULL, 'B1', NULL),
	(247, 121, '2015-11-26', 'C1', '2015-11-26 16:00:00', '2015-11-26 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '牛牛在三个小朋友中是稍微胆小一点的。但是踢腿是三个人中踢得最标准的，闭气是在这节课中学会的，来的时候只能在水中憋1秒。进步挺大。', 1, '教学课程', NULL, NULL, 210, '1153', NULL, '2009-07-12', '周株宇', '男', '', NULL, 'C1', NULL),
	(248, 121, '2015-11-26', 'C1', '2015-11-26 16:00:00', '2015-11-26 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '这个小朋友是三个人中最大的，潜水能力也是最强的，能憋气15秒以上。但是腿踢得不是很标准。', 1, '教学课程', NULL, NULL, 208, '1151', NULL, '2009-09-01', '杨铠珺', '男', '', NULL, 'C1', NULL),
	(249, 121, '2015-11-26', 'C1', '2015-11-26 16:00:00', '2015-11-26 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小朋友个子比较小，是三个人中最活跃的。喜欢乱跑，水性是三人中最好的一个。注意力相当不集中。', 1, '教学课程', NULL, NULL, 209, '1152', NULL, '2008-12-31', '甘怡豪', '男', '', NULL, 'C1', NULL),
	(250, 129, '2015-11-26', NULL, '2015-11-26 17:00:00', '2015-11-26 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '依依今天还是非常的不愿意潜水，但还是在我的陪同下一起潜水了一次。完全没有呛水的反应。潜的很好。但还是不愿意潜水。今天教会了她潜水起来后张开嘴吧用嘴巴呼吸。妈妈还是比较满意。', 1, '教学课程', NULL, NULL, 25, '005', NULL, '2011-02-05', '刘梁奕（Cathy)', '女', '南天阳光', NULL, 'C1', NULL),
	(251, 117, '2015-11-26', 'C1', '2015-11-26 15:30:00', '2015-11-26 16:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '嘉宇今天表现不错，刚开始还是练习闷气，之后漂浮，闷气漂浮还可以，打退还需要加强，带上浮漂打腿不怎么好。', 1, '教学课程', NULL, NULL, 148, '1100', NULL, '2009-09-24', '陈嘉宇', '男', '南昌市', NULL, 'C1', NULL),
	(252, 141, '2015-11-27', NULL, '2015-11-27 10:30:00', '2015-11-27 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '穰穰今天玩儿的非常的开心。试水反应能闭上眼睛。看来下次课程还是安排在人多的课堂有助于宝宝进步。', 1, '教学课程', NULL, NULL, 132, '027', NULL, '2015-02-28', '程鸣谦（穰穰）', '女', '红谷滩', NULL, 'A2', NULL),
	(253, 141, '2015-11-27', NULL, '2015-11-27 10:30:00', '2015-11-27 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '经过研究一一的状况，今天尝试了跳潜让他在他最喜欢的动作去完成了一次跳潜。效果还行，只不高兴了半分钟就很快的又开心的玩起来了。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝一（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(254, 141, '2015-11-27', NULL, '2015-11-27 10:30:00', '2015-11-27 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小满今天由妈妈带下水，表现不错，潜水了两次，没有呛水的迹象，说明闭气非常的好。', 1, '教学课程', NULL, NULL, 35, '019', NULL, '2013-12-24', '袁晨硕(小满）', '男', '南昌世茂', NULL, 'B1', NULL),
	(255, 141, '2015-11-27', NULL, '2015-11-27 10:30:00', '2015-11-27 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '端端胆子非常的大很开朗，爸爸带着他。试水反应很棒，就是对水还有点陌生。再上两次课潜水就完全没问题。跳水很大胆。', 1, '教学课程', NULL, NULL, 211, '1154', NULL, '2013-05-01', '端端', '男', '', NULL, 'B2', NULL),
	(259, 149, '2015-11-27', '', '2015-11-27 14:30:00', '2015-11-27 15:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，子聪今天表现很好，蹬腿意识越来越明显，试水也不错，跳水也蛮喜欢的，最后给宝宝潜水了，今天潜水没有哭。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(260, 315, '2015-11-27', 'C1', '2015-11-27 14:00:00', '2015-11-27 14:40:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '芷莹这节课玩得非常的开心，能稍微的弄一点水到脸上，没有问题。踢腿还是依然的棒。能很好的与果果交流。交际能力不错，自我介绍的时候非常的自信。', 1, '教学课程', NULL, NULL, 23, '004', NULL, '2011-11-22', '程芷莹（Celia）', '女', '保利高尔夫花园', NULL, 'C1', NULL),
	(261, 315, '2015-11-27', 'C1', '2015-11-27 14:00:00', '2015-11-27 14:40:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '果果今天进步很大。能用鼻子吐泡泡。教会了鼻子入水后起来用嘴巴呼吸，现在潜水完全没有问题。再练习两天，潜水就没有问题。', 1, '教学课程', NULL, NULL, 159, '024', NULL, '2012-04-29', '喻路丹（果果）', '女', '联发融德', NULL, 'C1', NULL),
	(263, 169, '2015-11-27', '', '2015-11-27 17:00:00', '2015-11-27 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '添恩今天学会了吐泡泡完了后用嘴巴呼吸。但是今天对于潜水比较抗拒，跳水还是有点胆小。', 1, '教学课程', NULL, NULL, 199, '040', NULL, '2013-03-08', '陈添恩', '女', '民德路民巷', NULL, 'B2', NULL),
	(264, 169, '2015-11-27', '', '2015-11-27 17:00:00', '2015-11-27 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬今天作为添恩的小哥哥带了个不错的头。自己浇水到头上给同学示范了，这也是彬彬第一次的自己做的试水反应。爸爸上课前要求他只上20分钟。最后玩得开心，彬彬上完了整节课。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
	(266, 173, '2015-11-27', '', '2015-11-27 17:40:00', '2015-11-27 18:40:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '开心今天表现的非常棒，腿也踢得很好，做了一次潜水。', 1, '教学课程', NULL, NULL, 212, '1155', NULL, '2013-04-30', '开心', '女', '', NULL, 'B2', NULL),
	(267, 181, '2015-11-28', NULL, '2015-11-28 10:00:00', '2015-11-28 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，果果蹬腿意识还可以，课堂中比较活跃，试水反应不怎么好，会张嘴巴，但是吐泡泡时，会学，跳水不错。', 1, '教学课程', NULL, NULL, 213, '1156', NULL, '2014-09-27', '祝沛涵', '男', '', NULL, 'B1', NULL),
	(268, 185, '2015-11-28', NULL, '2015-11-28 10:30:00', '2015-11-28 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，表现不错，蹬腿意识还需提高，试水很好，跳水不错。', 1, '教学课程', NULL, NULL, 214, '1157', NULL, '2013-02-22', '张艺恺', '男', '', NULL, 'B2', NULL),
	(269, 185, '2015-11-28', NULL, '2015-11-28 10:30:00', '2015-11-28 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，刚开始也是哭，妈妈在旁边安抚了一会就好了，试水表情有点夸张，但是还好，跳水不错。', 1, '教学课程', NULL, NULL, 174, '1124', NULL, '1899-12-31', '万益城', '男', '', NULL, 'B1', NULL),
	(270, 185, '2015-11-28', NULL, '2015-11-28 10:30:00', '2015-11-28 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，宝宝表现不怎么好，一直哭闹，可能是爸爸带下水的原因，宝宝一直看着妈妈，所以没做试水和跳水。', 1, '教学课程', NULL, NULL, 91, '1053', NULL, '2014-09-10', '皮特', '男', '南昌市', NULL, 'B1', NULL),
	(271, 189, '2015-11-28', '', '2015-11-28 11:00:00', '2015-11-28 12:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，刚开始宝宝不怎么进入状态，但是之后就好了，打腿蛮好，试水反应不错，跳水也可以。', 1, '教学课程', NULL, NULL, 215, '1158', NULL, '2012-07-01', '谢佳颖', '男', '', NULL, 'C1', NULL),
	(272, 197, '2015-11-28', NULL, '2015-11-28 15:00:00', '2015-11-28 16:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '一一今天表现的非常好不哭不闹，不过下水的时候还是有一点紧张。有潜水的潜质。', 1, '教学课程', NULL, NULL, 216, '1159', NULL, '2015-09-13', '一一', '男', '', NULL, 'A1', NULL),
	(273, 316, '2015-11-28', 'A1', '2015-11-28 11:05:00', '2015-11-28 12:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '牛牛今天的表现还不错有一点点的小进步，不过还是容易开小差。专注力有待提高', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(274, 316, '2015-11-28', 'A1', '2015-11-28 11:05:00', '2015-11-28 12:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '乐乐今天的表现不太好，一直想往岸上跑，不专注。动作的协调能力还需要加强', 1, '教学课程', NULL, NULL, 200, '041', NULL, '2009-11-02', '朱思远', '男', '万科四季花城小区', NULL, 'C1', NULL),
	(276, 201, '2015-11-28', NULL, '2015-11-28 15:30:00', '2015-11-28 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬上课 不怎么踢腿。踢腿需要加强练习。吐泡泡还不会吐。妈妈比较心大，有利于宝宝学习。宝宝比较喜欢说话，很有礼貌；。', 1, '教学课程', NULL, NULL, 182, '028', NULL, '2014-03-16', '黄昱彬（彬彬）', '女', '', NULL, 'B1', NULL),
	(277, 213, '2015-11-28', NULL, '2015-11-28 17:00:00', '2015-11-28 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '派派表现不错，与小宇一起上课效果很好。小家伙都争相去做试水反应，并且能自己倒水到头上，表现很好，做了潜水。', 1, '教学课程', NULL, NULL, 222, '1165', NULL, '2012-08-31', '侯清濯（派派）', '男', '', NULL, 'C1', NULL),
	(278, 213, '2015-11-28', NULL, '2015-11-28 17:00:00', '2015-11-28 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小朋友表现的有点害羞。试水反应做的比较好。也做了潜水。踢腿还需要加强练习。', 1, '教学课程', NULL, NULL, 221, '1164', NULL, '2011-01-28', '汪俊嘉', '男', '', NULL, 'C1', NULL),
	(279, 213, '2015-11-28', NULL, '2015-11-28 17:00:00', '2015-11-28 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小宇表现的比较活跃在三个人中是表现最好的，非常的喜欢水，能够自主的做试水反应，敢于站着跳水。潜水也完全没问题。', 1, '教学课程', NULL, NULL, 173, '1123', NULL, '2013-12-31', '叶禹浩', '男', '', NULL, 'B2', NULL),
	(280, 229, '2015-11-29', NULL, '2015-11-29 11:00:00', '2015-11-29 12:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '牛牛今天上课学习了交替自由泳手，做了还行，强调了手要贴耳朵入水。能完全脱离浮板。', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(281, 229, '2015-11-29', NULL, '2015-11-29 11:00:00', '2015-11-29 12:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '思远的自由泳腿还需要加强练习，打的太僵硬，踢起来完全失去平衡。这节课主要教授其有节奏的换气。强调起水时嘴巴张开呼吸。', 1, '教学课程', NULL, NULL, 200, '041', NULL, '2009-11-02', '朱思远', '男', '万科四季花城小区', NULL, 'C1', NULL),
	(283, 221, '2015-11-29', '', '2015-11-29 10:00:00', '2015-11-29 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸下水，子聪今天表现不好，哭的厉害，可能是不适应爸爸的原因，上来20分钟就上去了，但是踢腿还是很好。其他的没做。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(284, 225, '2015-11-29', '', '2015-11-29 10:30:00', '2015-11-29 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，mitch今天的表现不错，蹬腿明显比上节课好，也做了试水反应，跳水很好。', 1, '教学课程', NULL, NULL, 179, '1128', NULL, '2013-12-31', 'Mitch', '男', '', NULL, 'A1', NULL),
	(285, 225, '2015-11-29', '', '2015-11-29 10:30:00', '2015-11-29 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '姥爷带下水，还是没妈妈带下水的表现好，不听姥爷的指挥，蹬腿不怎么好，试水还可以，跳水也不错，没潜水。', 1, '教学课程', NULL, NULL, 35, '019', NULL, '2013-12-24', '袁晨硕(小满）', '男', '南昌世茂', NULL, 'B1', NULL),
	(286, 225, '2015-11-29', '', '2015-11-29 10:30:00', '2015-11-29 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，一一今天的表现不好，可能是爸爸有段时间没带了，哭闹的厉害，蹬腿意识还需提高，试水就哭，跳水还好。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝一（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(287, 225, '2015-11-29', '', '2015-11-29 10:30:00', '2015-11-29 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，梓童今天表现还不错，蹬腿还好，试水还是会紧张，脸部会打斗，跳水蛮好。', 1, '教学课程', NULL, NULL, 198, '1143', NULL, '2013-05-12', '张梓童', '女', '', NULL, 'B2', NULL),
	(288, 237, '2015-11-29', NULL, '2015-11-29 15:00:00', '2015-11-29 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '豆豆是三个同学中最小的，表现比较淡定，小腿踢得不错。比较喜欢水，在水下待了二十多分钟就上岸了。综合表现不错。', 1, '教学课程', NULL, NULL, 225, '1168', NULL, '2015-02-04', '蔡长坤（豆豆）', '男', '', NULL, 'A2', NULL),
	(289, 237, '2015-11-29', NULL, '2015-11-29 15:00:00', '2015-11-29 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小陈最先下水，因为太困的原因不是非常的兴奋，趴在爸爸的肩膀上几乎就睡着了。没有系统的开始上课就上岸了。', 1, '教学课程', NULL, NULL, 224, '1167', NULL, '2014-05-05', '陈铭洋', '男', '', NULL, 'B1', NULL),
	(290, 237, '2015-11-29', NULL, '2015-11-29 15:00:00', '2015-11-29 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '多多在岸边是适应了最久的，也是今天上课表现最好的，相比上次的进步实在太大了。让人很意外。仰漂能很好的躺着。试水反应也能非常好的完成。', 1, '教学课程', NULL, NULL, 226, '1169', NULL, '2014-01-01', '多多', '男', '', NULL, 'B1', NULL),
	(291, 317, '2015-11-29', 'c1', '2015-11-29 11:05:00', '2015-11-29 12:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，刚开始宝宝不怎么配合，后面可以了，试水不错，能闷气15秒，打腿还需要提高。', 1, '教学课程', NULL, NULL, 217, '1160', NULL, '2009-10-01', '余瑗宸', '女', '南昌市', NULL, 'C1', NULL),
