	(294, 252, '2015-11-29', NULL, '2015-11-29 15:30:00', '2015-11-29 16:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，蹬腿意识很好，试水不错，跳水也很好。', 1, '教学课程', NULL, NULL, 135, '1089', NULL, '2015-01-06', '李修齐', '男', '南昌市', NULL, 'A2', NULL),
