	(304, 247, '2015-12-02', 'A1', '2015-12-02 10:00:00', '2015-12-02 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，宝宝表现不错，试水还好，跳水也不错，但是蹬腿意识还需要提高。', 1, '教学课程', NULL, NULL, 229, '1172', NULL, '2014-12-20', '罗晨尹', '女', '', NULL, 'B1', NULL),
