	(309, 252, '2015-12-02', 'B1', '2015-12-02 10:30:00', '2015-12-02 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，潇潇今天表现不错，试水不错，跳水也好，给她海豹潜了，可能第一次，有点不适应。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市红谷滩名门世家', NULL, 'B2', NULL),
