	(317, 292, '2015-12-02', 'C1', '2015-12-02 17:40:00', '2015-12-02 18:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬上周日没来，今天又对水有点陌生了，有两个小朋友陪他玩，做了试水反应，不怎么愿意做给的指令，其他小朋友完成了吹泡泡跳水，他没有做。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
	(318, 267, '2015-12-02', '', '2015-12-02 15:00:00', '2015-12-02 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '苗苗今天玩的比较开心，下水比较活跃， 腿不怎么愿意踢。妈妈对于苗苗的表现还算满意。', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
