	(375, 467, '2015-12-06', '', '2015-12-06 15:00:00', '2015-12-06 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '乐儿很小，妈妈下水。基本是在做仰漂的动作，在过彩虹桥的时候乐儿会跟着桥的动作跟着动起来。妈妈明确说很满意这种能够吸引到她孩子的课程。喜欢这种有互动的课程。', 1, '教学课程', NULL, NULL, 231, '045', NULL, '2015-07-13', '徐歆蕾（乐儿）', '女', '', NULL, 'A1', NULL),
