	(377, 494, '2015-12-06', '', '2015-12-06 12:00:00', '2015-12-06 13:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '九月在水中玩的很好。试水反应ok。跳水敢来个小助跑跳水，这也是第一个这年龄段的小朋友敢这么跳。潜水是完全没有问题，就是还有些胆怯。需要在多练习几次。', 1, '教学课程', NULL, NULL, 220, '1163', NULL, '2012-09-02', '九月', '女', '南昌市', NULL, 'C1', NULL),
	(379, 455, '2015-12-06', '', '2015-12-06 10:30:00', '2015-12-06 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，mitch今天表现很好，蹬腿意识有进步，今天也试水了，还可以，跳水很喜欢。', 1, '教学课程', NULL, NULL, 179, '1128', NULL, '2013-12-31', 'Mitch', '男', '', NULL, 'A1', NULL),
	(380, 455, '2015-12-06', '', '2015-12-06 10:30:00', '2015-12-06 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，畅畅表现不错，蹬腿意识可以，试水有点张嘴巴，跳水不错。', 1, '教学课程', NULL, NULL, 239, '1180', NULL, '2013-11-02', '何诚悎', '男', '', NULL, 'A1', NULL),
	(381, 455, '2015-12-06', '', '2015-12-06 10:30:00', '2015-12-06 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，豆豆今天表现不错，就是胆子有点小，试水还可以，跳水没有不敢。', 1, '教学课程', NULL, NULL, 238, '1179', NULL, '2013-11-09', '唐轲（糖豆、豆豆）', '女', '', NULL, 'B1', NULL),
