	(395, 273, '2015-12-09', NULL, '2015-12-09 16:00:00', '2015-12-09 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '苗苗今天很兴奋，下水就开始双腿双手动个不停。试水反应会闭眼，但是不会闭上嘴巴， 和妈妈嘴对嘴潜水了一次。效果还行，喝了一点水，但是完全没有不开心的迹象。', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(396, 273, '2015-12-09', NULL, '2015-12-09 16:00:00', '2015-12-09 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '满满小腿也是蹬的很好，试水反应做的不错。闭眼闭嘴吧了。用了长浮条练习蹬腿了，效果不错。和妈妈一起潜水了一次，有呛水的迹象，也哭了。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(397, 273, '2015-12-09', NULL, '2015-12-09 16:00:00', '2015-12-09 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '杰西米下水会哭，对环境很陌生，妈妈一直在一旁耐心的带着她。做了一次试水反应，效果不错，没有很排斥。', 1, '教学课程', NULL, NULL, 116, '1075', NULL, '2014-12-02', '郭扬铭', '女', '南昌朝阳大桥', NULL, 'A2', NULL),
	(398, 268, '2015-12-09', NULL, '2015-12-09 15:00:00', '2015-12-09 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '修齐在水中呆了将近20分钟。开始一直玩的还不错，也有笑的很开心，捡完了小球，让其坐在岸边做试水反应时看到身上起疹子，然后就上岸了。', 1, '教学课程', NULL, NULL, 135, '044', NULL, '2015-01-06', '李修齐', '男', '南昌市', NULL, 'A2', NULL),
	(399, 248, '2015-12-09', NULL, '2015-12-09 10:00:00', '2015-12-09 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，小可刚开始不愿下水，之后就下去了。蹬腿意识还好，试水也不错，跳水自主意识还没有。', 1, '教学课程', NULL, NULL, 247, '1087', NULL, '2014-02-17', '马雨成（小可）', '男', '', NULL, 'B1', NULL),
	(400, 248, '2015-12-09', NULL, '2015-12-09 10:00:00', '2015-12-09 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天乐儿状态不好，仰漂会哭闹。用了玩具逗她还是一样。', 1, '教学课程', NULL, NULL, 231, '045', NULL, '2015-07-13', '徐歆蕾（乐儿）', '女', '', NULL, 'A1', NULL),
	(401, 248, '2015-12-09', NULL, '2015-12-09 10:00:00', '2015-12-09 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，朵朵还是很平静，蹬腿意识还需加强，试水不错，能闭眼，闭嘴。跳水的主动意识比上次好。', 1, '教学课程', NULL, NULL, 230, '048', NULL, '2014-11-23', '杨欣语（朵朵）', '女', '绿地', NULL, 'B1', NULL),
	(402, 253, '2015-12-09', NULL, '2015-12-09 10:30:00', '2015-12-09 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，小满今天表现不错，蹬腿好，试水也不错，跳水也很好，唯一还需注意的就是手里喜欢拿个玩具。', 1, '教学课程', NULL, NULL, 35, '019', NULL, '2013-12-24', '袁晨硕(小满）', '男', '南昌世茂', NULL, 'B1', NULL),
