	(404, 253, '2015-12-09', NULL, '2015-12-09 10:30:00', '2015-12-09 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，潇潇表现很好，蹬腿意识不错，试水也好，现在会跳潜了，潜水能自己在水下蹬腿浮上来。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市洪城比华利', NULL, 'B2', NULL),
	(405, 253, '2015-12-09', NULL, '2015-12-09 10:30:00', '2015-12-09 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，一好今天表现不怎么好，蹬腿不怎么愿意，试水还可以，跳水不错，今天不愿潜水。', 1, '教学课程', NULL, NULL, 190, '033', NULL, '2013-08-16', '王恩哲一好', '男', '红谷滩新地阿尔法', NULL, 'B2', NULL),
