	(410, 303, '2015-12-10', NULL, '2015-12-10 10:00:00', '2015-12-10 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '乐儿今天表现的很好，教练带下水没有哭闹，现在随着年龄的增长不太愿意躺了', 1, '教学课程', NULL, NULL, 231, '045', NULL, '2015-07-13', '徐歆蕾（乐儿）', '女', '', NULL, 'A1', NULL),
	(411, 308, '2015-12-10', NULL, '2015-12-10 10:30:00', '2015-12-10 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '睿睿今天的表现一般，对试水反应极其抗拒，奶奶比较随意，还是要由妈妈带下水会好一点。', 1, '教学课程', NULL, NULL, 28, '016', NULL, '2013-07-06', '刘梁睿', '男', '红谷十二庭', NULL, 'B2', NULL),
	(412, 308, '2015-12-10', NULL, '2015-12-10 10:30:00', '2015-12-10 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '潇潇依旧是表现的很棒，现在主要加深潜水的深度和潜水的时间。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市洪城比华利', NULL, 'B2', NULL),
	(413, 308, '2015-12-10', NULL, '2015-12-10 10:30:00', '2015-12-10 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '萱萱表现一般，专注力不够，在课堂上没有什么活力。太过依赖家长。试水反应会闭眼睛但是会张嘴，还有待提高。', 1, '教学课程', NULL, NULL, 131, '1086', NULL, '2014-11-18', '袁梓萱', '女', '南昌市洪都大道', NULL, 'B1', NULL),
	(414, 318, '2015-12-10', NULL, '2015-12-10 14:30:00', '2015-12-10 15:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，苗苗今天表现很好，蹬腿意识好，对仰漂不是太喜欢，不喜欢头进水，试水还是会张嘴巴，跳水有点意识，让妈妈跟苗苗一起潜水了，效果还不错。', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(415, 323, '2015-12-10', NULL, '2015-12-10 15:00:00', '2015-12-10 15:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，刚开始妈妈有点紧张，后面好了，康康在水中很安静，不紧张，有点蹬腿的意识，仰漂也很好。', 1, '教学课程', NULL, NULL, 249, '1089', NULL, '2015-07-24', '张烁（康康）', '男', '万达华府', NULL, 'A1', NULL),
	(416, 338, '2015-12-10', NULL, '2015-12-10 16:30:00', '2015-12-10 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '畅畅有点腼腆。但是踢腿的意识很好，基本没停下来，教练的指令能很好的完成。跳水跳的很棒，跳的很高。妈妈很开心。', 1, '教学课程', NULL, NULL, 239, '1180', NULL, '2013-11-02', '何诚悎', '男', '', NULL, 'A1', NULL),
	(417, 338, '2015-12-10', NULL, '2015-12-10 16:30:00', '2015-12-10 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '萱萱下水很开心，是三个小朋友里面最兴奋的，踢腿意识非常强，脸上沾水也不会惧怕。试水反应却有些紧张，不愿意进行。可能是以前试水反应有点阴影，需要再多加锻炼。跳水不敢跳。', 1, '教学课程', NULL, NULL, 71, '029', NULL, '2013-11-07', '杜雅萱', '女', '南昌市', NULL, 'B1', NULL),
	(419, 343, '2015-12-10', NULL, '2015-12-10 17:00:00', '2015-12-10 17:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '依依现在对水很熟悉了，能随意的自己玩儿，绑着浮漂自己玩都没问题，就是对于潜水还是有点害怕，试水反应完全没问题，跳水也很大胆、现在就是需要再加强她潜水的能力、', 1, '教学课程', NULL, NULL, 25, '005', NULL, '2011-02-05', '刘梁奕（Cathy)', '女', '南天阳光', NULL, 'C1', NULL),
	(420, 343, '2015-12-10', NULL, '2015-12-10 17:00:00', '2015-12-10 17:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬现在进步很大，踢腿意识很强了，能够很好的完成教练的指令了，做了一次漂亮的跳水，跳的很高，爸爸非常的开心，试水反应做完了，效果还行，比以前好多了。注意力也比集中了。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
	(422, 293, '2015-12-09', NULL, '2015-12-10 17:40:00', '2015-12-10 18:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '饺子现在是非常的难办，注意力相当的不集中，基本完成不了任何给出的指令。爸爸还是很配合。需要让其多多锻炼。', 1, '教学课程', NULL, NULL, 177, '1127', NULL, '2013-01-01', '吴泊然', '男', '', NULL, 'C1', NULL),
	(423, 494, '2015-12-10', '', '2015-12-10 17:30:00', '2015-12-10 18:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '军军琪琪今天表现的都有进步还需要继续加油', 1, '教学课程', NULL, NULL, 122, '025', NULL, '2007-12-21', '刘彦军/刘子琪', '男', '海波澜庭', NULL, 'C1', NULL),
	(424, 379, '2015-12-11', NULL, '2015-12-11 15:00:00', '2015-12-11 15:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，子聪今天表现不错，蹬腿意识很好，特别是跳水入水后腿马上能踢起来，试水不错。潜水也做的不错。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(425, 367, '2015-12-11', NULL, '2015-12-11 10:30:00', '2015-12-11 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小满今天上课表现还行，姥爷的确是带着他到处跑，不怎么受控制，下水就潜水了一次，试水反应良好，踢腿效果良好。', 1, '教学课程', NULL, NULL, 35, '019', NULL, '2013-12-24', '袁晨硕(小满）', '男', '南昌世茂', NULL, 'B1', NULL),
	(426, 367, '2015-12-11', NULL, '2015-12-11 10:30:00', '2015-12-11 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '一一今天有点小脾气，下水后就好了一些，试水反应看到杯子就很紧张，踢腿意识还差点，妈妈给他潜水了几次，都完全没有呛水。就不高兴了一下，妈妈严肃的让他继续踢腿，就立马不哭认真踢腿了。妈妈说给了他时间去适应了。让他知道这件事必须要去做。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝祎（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(427, 367, '2015-12-11', NULL, '2015-12-11 10:30:00', '2015-12-11 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '潇潇今天有点不受控制，太嗨了。所有的动作都完成了。随便扔水里都没问题，小腿蹬的挺快，能自己从水里蹬起来。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市洪城比华利', NULL, 'B2', NULL),
	(428, 367, '2015-12-11', NULL, '2015-12-11 10:30:00', '2015-12-11 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '三元有点重了，妈妈带他有些困难。踢腿意识不强，试水反应还没有效果，非常的紧张，不会闭嘴闭眼。', 1, '教学课程', NULL, NULL, 253, '1190', NULL, '2013-07-26', '郭劭沅（三元）', '男', '保利', NULL, 'B2', NULL),
	(432, 371, '2015-12-11', NULL, '2015-12-11 11:00:00', '2015-12-11 11:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '乐儿今天是我自己带下水，带着她趴在水中游了，也让她在水中躺着，小宝宝不喜欢躺着。对于新鲜事物的玩具能很好的吸引到她注意力。', 1, '教学课程', NULL, NULL, 231, '045', NULL, '2015-07-13', '徐歆蕾（乐儿）', '女', '', NULL, 'A1', NULL),
	(433, 395, '2015-12-11', NULL, '2015-12-11 17:00:00', '2015-12-11 17:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，小C今天表现不好，刚开始还踢水了，后面就不行了，试水还好，跳水没做。后面就上去了。', 1, '教学课程', NULL, NULL, 171, '1121', NULL, '2013-12-31', '叶长曦', '男', '', NULL, 'C1', NULL),
	(434, 395, '2015-12-11', NULL, '2015-12-11 17:00:00', '2015-12-11 17:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，芷莹今天就练习了踢腿，试水没做，跳水也没做，不喜欢这些，爸爸也说了她不喜欢就算了。', 1, '教学课程', NULL, NULL, 23, '004', NULL, '2011-11-22', '程芷莹（Celia）', '女', '保利高尔夫花园', NULL, 'C1', NULL),
	(436, 415, '2015-12-12', NULL, '2015-12-12 11:00:00', '2015-12-12 11:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '牛牛上课时特别容易开小差，专注度要加强。动作没有什么进步', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(437, 415, '2015-12-12', NULL, '2015-12-12 11:00:00', '2015-12-12 11:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '豆豆的动作很散漫，上课还不够认真，动作还需要进一步的定型。', 1, '教学课程', NULL, NULL, 234, '039', NULL, '2010-08-31', '李贤一（豆豆）', '男', '', NULL, 'C1', NULL),
	(439, 420, '2015-12-12', NULL, '2015-12-12 14:30:00', '2015-12-12 15:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '松松刚到一个陌生的环境很紧张，没有安全感，上课不太活跃，快到下课的时候才完全放松了下来，下节课应该会更好。', 1, '教学课程', NULL, NULL, 255, '1191', NULL, '2014-04-12', '毛彦松（松松）', '男', '', NULL, 'A2', NULL),
	(440, 420, '2015-12-12', NULL, '2015-12-12 14:30:00', '2015-12-12 15:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '君浩的表现很活跃，腿也打得很好，但是对什么都很好奇，还不够专注。', 1, '教学课程', NULL, NULL, 256, '1192', NULL, '2013-12-17', '盖君浩', '男', '', NULL, 'B1', NULL),
	(442, 407, '2015-12-12', NULL, '2015-12-12 10:00:00', '2015-12-12 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，苗苗今天的状态不怎么好，想睡觉，蹬腿可以，今天试水有两次闭嘴巴了，但是之后又会张嘴巴，跳水不错。', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(443, 444, '2015-12-12', NULL, '2015-12-12 17:05:00', '2015-12-12 17:50:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '蛋蛋是姥姥带下水的，上课的时候比较随意，专注力还要加强。试水反应一般，还会张嘴巴。', 1, '教学课程', NULL, NULL, 257, '1193', NULL, '2014-12-09', '李佩珊（蛋蛋）', '女', '', NULL, 'B1', NULL),
	(444, 424, '2015-12-12', NULL, '2015-12-12 15:00:00', '2015-12-12 15:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '乐儿今天的情绪有点不稳定，时好时坏，还是需要由妈妈带下水比较好。', 1, '教学课程', NULL, NULL, 231, '045', NULL, '2015-07-13', '徐歆蕾（乐儿）', '女', '', NULL, 'A1', NULL),
	(445, 424, '2015-12-12', NULL, '2015-12-12 15:00:00', '2015-12-12 15:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '一一表现的很好，试水反应很OK,下一节课就可以短潜一下了', 1, '教学课程', NULL, NULL, 216, '042', NULL, '2015-09-13', '夏霁然一一', '女', '保利', NULL, 'A1', NULL),
	(446, 424, '2015-12-12', NULL, '2015-12-12 15:00:00', '2015-12-12 15:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '琪琪今天表现的还行，仰漂很有进步，不会乱动。试水反应会张嘴巴，还需要继续努力。', 1, '教学课程', NULL, NULL, 114, '046', NULL, '2015-07-04', '李雯妤奇奇', '女', '红谷春天花园', NULL, 'A2', NULL),
	(447, 428, '2015-12-12', NULL, '2015-12-12 15:30:00', '2015-12-12 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬现在是模仿学语时期，很聪明的模仿大人们的话，但是对于大人们的动作模仿还有些欠缺，对于在水中踢腿，还是没有意识，需要多加的训练，吐泡泡勉强能够完成，跳水环节是她非常喜欢的，嘴巴一直喊着要跳水。妈妈对其要求比较高，她不踢腿的时候，就会强制慢慢的让其嘴巴入水，从而达到彬彬挣扎踢水的目的。妈妈说这是她的教育方式。彬彬对这方式倒没什么阴影。', 1, '教学课程', NULL, NULL, 182, '028', NULL, '2014-03-16', '黄昱彬（彬彬）', '女', '', NULL, 'B1', NULL),
	(448, 436, '2015-12-12', NULL, '2015-12-12 16:30:00', '2015-12-12 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '依依现在借助背漂和三角板能够自己自如的在泳池里玩，妈妈也是很自豪她能够这样，今天让她自己练习了打腿，以及给她做了试水反应，浇水5秒钟都没有问题。吐泡泡也没有问题。', 1, '教学课程', NULL, NULL, 25, '005', NULL, '2011-02-05', '刘梁奕（Cathy)', '女', '南天阳光', NULL, 'C1', NULL),
	(449, 436, '2015-12-12', NULL, '2015-12-12 16:30:00', '2015-12-12 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '睿睿今天有些情绪，下水后兴致不高，逐渐才慢慢活跃起来，踢腿意识不高，有些懒，试水反应做了但是会紧张。', 1, '教学课程', NULL, NULL, 28, '016', NULL, '2013-07-06', '刘梁睿', '男', '红谷十二庭', NULL, 'B2', NULL),
	(450, 436, '2015-12-12', NULL, '2015-12-12 16:30:00', '2015-12-12 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '哈密妈妈对其要求很高，妈妈说他爸爸什么都依着他，而她就是反派角色，哈密在这样环境下很勇敢，敢自己走到水没到嘴巴的地方。然后自己跳到妈妈的手上，试水反应良好，吐泡泡有点欠缺，跳水在妈妈的强烈要求下敢于自己站着跳水。', 1, '教学课程', NULL, NULL, 214, '1157', NULL, '2013-02-22', '张艺恺', '男', '', NULL, 'B2', NULL),
	(451, 440, '2015-12-12', NULL, '2015-12-12 17:00:00', '2015-12-12 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '圆圆今天爸爸带下水，圆圆的腿踢得很不错，这与其以前上课一直学习到的分不开。就是胆子有点小，不相信自己能够做到自己本该能够做到的事情。跳水在爸爸的努力配合下完成了，而且喜欢上了跳水。吐泡泡吐的非常的好，试水反应3秒浇水没问题。可以潜水，但缺乏自信，还需要多加表扬增加其自信心。', 1, '教学课程', NULL, NULL, 20, '001', NULL, '2011-08-09', '李思源（圆圆）', '男', '滨江豪园', NULL, 'C1', NULL),
	(452, 460, '2015-12-13', NULL, '2015-12-13 11:00:00', '2015-12-13 11:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '牛牛现在不需要任何辅助工具都能在水中玩的来去自如。能够在水中笔直身体漂浮踢腿游十米没问题。现在就是要加强手臂的动作，基本就完美了。', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(453, 460, '2015-12-13', NULL, '2015-12-13 11:00:00', '2015-12-13 11:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '豆豆的水性是非常好的，能够独立潜水到水底取物。就是动作的标准还需要加强，动起手来了脚就不标准了，还是要多加练习踢腿。', 1, '教学课程', NULL, NULL, 234, '039', NULL, '2010-08-31', '李贤一（豆豆）', '男', '', NULL, 'C1', NULL),
	(455, 464, '2015-12-13', NULL, '2015-12-13 14:30:00', '2015-12-13 15:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小小距离上次游泳有大半个月的时间了。今天迟到了大半节课，来的时候已经在练习吐泡泡了，开始在水中不怎么踢腿，在结束的时候才逐渐的开始了踢腿。踢得很棒，试水反应很好。', 1, '教学课程', NULL, NULL, 22, '003', NULL, '2015-04-19', '万子瑜小小', '男', '南昌红谷滩', NULL, 'A1', NULL),
	(456, 464, '2015-12-13', NULL, '2015-12-13 14:30:00', '2015-12-13 15:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '满满是个爱运动的小能手，在水中踢个不停，妈妈也是很满意他的表现，试水反应没问题，潜水还是会呛一点，。需要加强。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(458, 468, '2015-12-13', NULL, '2015-12-13 15:00:00', '2015-12-13 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '可乐踢腿 的效果很好，愿意去踢腿，而且很标准，妈妈对于宝宝的表现很满意，试水反应勉强做了，第一次能做到这样还不错。', 1, '教学课程', NULL, NULL, 264, '1200', NULL, '2014-03-18', '史泽明（cola）', '女', '', NULL, 'A1', NULL),
	(459, 468, '2015-12-13', NULL, '2015-12-13 15:00:00', '2015-12-13 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '利利比较喜欢水，妈妈对于宝宝的要求会比较高，仰漂宝宝不怎么喜欢去做，但是妈妈让她很好的做完了。试水反应一般，踢腿的意识很好。', 1, '教学课程', NULL, NULL, 265, '1201', NULL, '2014-01-22', '利利', '男', '', NULL, 'B1', NULL),
	(460, 468, '2015-12-13', NULL, '2015-12-13 15:00:00', '2015-12-13 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '多多现在是进步很大啦，在水中玩的很自如了，跟着爷爷玩的很开心，踢腿效果还是差点，但是试水反应很好，现在很喜欢水了。', 1, '教学课程', NULL, NULL, 226, '1169', NULL, '2014-01-01', '多多', '男', '', NULL, 'B1', NULL),
	(461, 476, '2015-12-13', NULL, '2015-12-13 16:00:00', '2015-12-13 16:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '子墨太久没有来了，刚开始下水连闷气都不会了，让他做了几次就进入状态了，现在打腿不错，刚开始戴着背漂打腿很好，给她脱掉了背漂打腿了，效果不错，胆子有点小。练习了一下手臂。', 1, '教学课程', NULL, NULL, 36, '018', NULL, '2010-05-13', '万子墨（Andy）', '男', '南昌莲塘', NULL, 'C1', NULL),
	(462, 452, '2015-12-13', '', '2015-12-13 10:00:00', '2015-12-13 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，早上苗苗上课都没什么状态，上了一下就哭了，后面越哭越厉害，就上岸了。', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(463, 452, '2015-12-13', '', '2015-12-13 10:00:00', '2015-12-13 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，果果今天表现还好，试水不错，但是踢腿意识还是不怎么好，喜欢仰漂踢腿，跳水也不错，今天潜水了，效果蛮好。', 1, '教学课程', NULL, NULL, 213, '1156', NULL, '2014-09-27', '祝沛涵', '男', '', NULL, 'B1', NULL),
	(464, 456, '2015-12-13', '', '2015-12-13 10:30:00', '2015-12-13 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天皮特表现很好，不再哭闹，整堂课都很安静，试水不错，跳水也很好。', 1, '教学课程', NULL, NULL, 91, '1053', NULL, '2014-09-10', '皮特', '男', '南昌市', NULL, 'B1', NULL),
	(465, 456, '2015-12-13', '', '2015-12-13 10:30:00', '2015-12-13 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，mitch今天表现没有上次好，试水不愿做了，可能是今天人比较少，没有那个氛围，跳水还可以，但是做了两次就不做了，开始哭闹要上去了。', 1, '教学课程', NULL, NULL, 179, '1128', NULL, '2013-12-31', 'Mitch', '男', '', NULL, 'A1', NULL),
