	(467, 480, '2015-12-13', '', '2015-12-13 16:30:00', '2015-12-13 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '曦曦今天下水了一直哭，没有进行任何教学。一直在一旁安抚。', 1, '教学课程', NULL, NULL, 268, '1204', NULL, '2014-05-12', '涂墨晨曦（曦曦）', '女', '', NULL, 'B1', NULL),
	(468, 480, '2015-12-13', '', '2015-12-13 16:30:00', '2015-12-13 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '芒果今天玩的很好，试水反应很棒，跳水还有点胆怯，爸爸带下水的。偶尔芒果有点情绪妈妈在一旁鼓励一下就又开始玩的开心了。', 1, '教学课程', NULL, NULL, 137, '1090', NULL, '2014-06-24', '吴若辰（芒果）', '男', '下罗', NULL, 'B1', NULL),
	(470, 495, '2015-12-13', '', '2015-12-13 11:10:00', '2015-12-13 12:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，川川今天的表现很好，每个方面都做的很出色，因为试水很好，就给他潜水了，效果也不错，站立跳水的时候爸爸没接住，川川直接就潜水下了，但是上来没有呛水，水性好。', 1, '教学课程', NULL, NULL, 261, '1197', NULL, '2012-12-12', '川川', '男', '', NULL, 'C1', NULL),
	(471, 472, '2015-12-13', '', '2015-12-13 15:30:00', '2015-12-13 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '一一今天表现的很好，全程都在笑嘻嘻，完成了试水反应，踢腿意识很强了。跳水也跳的很棒，潜水了两次，妈妈强行按水里去的，上来没有呛水的迹象，哭了两秒就好了。   ', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝祎（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(472, 472, '2015-12-13', '', '2015-12-13 15:30:00', '2015-12-13 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '乐乐下水了就哭。全程没加入到课堂上来。爸爸妈妈在一旁安抚。', 1, '教学课程', NULL, NULL, 266, '1202', NULL, '2014-01-22', '乐乐', '男', '', NULL, 'B1', NULL),
	(473, 472, '2015-12-13', '', '2015-12-13 15:30:00', '2015-12-13 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '添添妈妈很怕水，全程都是站在岸边，不敢动，孩子一直在拍水拍个不停，很开心第一次见到这么喜欢水的小朋友，一脸的水都一点不在乎。', 1, '教学课程', NULL, NULL, 267, '1203', NULL, '2014-05-15', '夏添', '男', '', NULL, 'B1', NULL),
	(474, 472, '2015-12-13', '', '2015-12-13 15:30:00', '2015-12-13 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '毛豆一下水还有点儿认生，没有太大的反应，大概上了十分钟左右就开始哭了，后来勉强坚持了一节课。很容易受到环境的影响笑起来。', 1, '教学课程', NULL, NULL, 269, '1205', NULL, '2014-11-07', '陈盛泽（毛豆）', '男', '', NULL, 'B1', NULL),
	(475, 472, '2015-12-13', '', '2015-12-13 15:30:00', '2015-12-13 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', 'leo 是妈妈带下来的第二个宝贝。妈妈喜欢带着他乱跑，有点不受控制。妈妈会游泳。试水反应一般，跳水还行。', 1, '教学课程', NULL, NULL, 270, '1206', NULL, '2014-11-13', '李一鸥（leo）', '男', '', NULL, 'B1', NULL),
	(476, 269, '2015-12-16', NULL, '2015-12-16 15:00:00', '2015-12-16 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '苗苗今天状态很好，下水笑个不停，一直在双腿蹬，两只手也没停下来一直在拍水。试水反应还是没闭嘴巴。没有最潜水。', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(477, 269, '2015-12-16', NULL, '2015-12-16 15:00:00', '2015-12-16 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '满满今天状态不错。还是一样的一直在踢腿。双腿交替的踢。试水反应很好，做了一次潜水。哭了，很紧张。眼睛没有红表明没呛水。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(479, 249, '2015-12-16', NULL, '2015-12-16 10:00:00', '2015-12-16 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，可能是第一次比较抗拒下水，下水就哭，给玩具好了一会，又哭了，吐泡泡给他看，打腿给他看，看的时候不会，过了一会又哭了，注意力集中就不会哭，一停下来就哭。', 1, '教学课程', NULL, NULL, 271, '1207', NULL, '2014-09-11', '李亦博（土豆）', '男', '', NULL, 'B1', NULL),
