	(481, 254, '2015-12-16', NULL, '2015-12-16 10:30:00', '2015-12-16 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天一好下水带了游泳镜，蹬腿不错，试水因为带了眼镜没能试出效果，跳水现在不敢站立跳了，潜水跟妈妈一起潜的，不会呛水，上来也跟妈妈说了，现在游泳不要给他戴游泳镜，原因也说了。', 1, '教学课程', NULL, NULL, 190, '033', NULL, '2013-08-16', '王恩哲一好', '男', '红谷滩新地阿尔法', NULL, 'B2', NULL),
	(482, 254, '2015-12-16', NULL, '2015-12-16 10:30:00', '2015-12-16 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天一一很活跃，蹬腿现在很明显了，试水也没有哭，跳水还是跟原来一样很喜欢，今天传递潜了，潜完之后用玩具让他注意力转移。就没哭了。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝祎（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(483, 254, '2015-12-16', NULL, '2015-12-16 10:30:00', '2015-12-16 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天小满表现很好，大水量试水完全可以，跳水也很好，唯一不足的就是好动，喜欢拿东西。现在已经能够跳潜了。', 1, '教学课程', NULL, NULL, 35, '019', NULL, '2013-12-24', '袁晨硕(小满）', '男', '南昌世茂', NULL, 'B1', NULL),
	(484, 294, '2015-12-16', NULL, '2015-12-16 17:40:00', '2015-12-16 18:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬今天一个人上课，表现还是很好，现在踢腿的意识很好了。试水反应现在都习惯去完成，稍微有点紧张。交给的任务全部能完成。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
