	(486, 274, '2015-12-16', NULL, '2015-12-16 16:00:00', '2015-12-16 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', 'celia 现在在水中很活跃，自我介绍也很仔细，踢腿意识不错了。吐泡勉强能够完成，对于自己能够做到的吐泡泡还是不仔细，说到做什么都会说我不行。今天潜水了，钻了圈圈，愉快的完成，。', 1, '教学课程', NULL, NULL, 23, '004', NULL, '2011-11-22', '程芷莹（Celia）', '女', '保利高尔夫花园', NULL, 'C1', NULL),
	(487, 274, '2015-12-16', NULL, '2015-12-16 16:00:00', '2015-12-16 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '果果跳水很大胆。每次跳水都是让爸爸退远一点。吐泡泡能够完成，但是不愿意做试水反应。也不愿意潜水，其实其能力是完全能够完成。', 1, '教学课程', NULL, NULL, 159, '024', NULL, '2012-04-29', '喻路丹（果果）', '女', '联发融德', NULL, 'C1', NULL),
	(488, 274, '2015-12-16', NULL, '2015-12-16 16:00:00', '2015-12-16 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '饺子依然是一节课基本没完成任何交代的任务，爸爸强行给按水里几次，都没有问题。他也没哭。，思绪飘忽不定。', 1, '教学课程', NULL, NULL, 177, '1127', NULL, '2013-01-01', '吴泊然', '男', '', NULL, 'C1', NULL),
