	(495, 309, '2015-12-17', NULL, '2015-12-17 10:30:00', '2015-12-17 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '君浩表现的非常活跃，潜水和踢水都做得不错。但是爸爸过于随心所遇。', 1, '教学课程', NULL, NULL, 256, '1192', NULL, '2013-12-17', '盖君浩', '男', '', NULL, 'B1', NULL),
	(496, 309, '2015-12-17', NULL, '2015-12-17 10:30:00', '2015-12-17 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '开心今天表现的很棒一直在踢水，潜水也很好。', 1, '教学课程', NULL, NULL, 212, '034', NULL, '2013-04-30', '朱恩禧开心', '女', '', NULL, 'B2', NULL),
