	(511, 50, '2015-10-16', 'B1', '2015-12-18 10:00:00', '2015-12-18 10:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '00', 1, '教学课程', NULL, NULL, 85, '1050', NULL, '2014-01-01', '腾子谦', '男', '1', NULL, 'B1', NULL),
	(512, 368, '2015-12-18', NULL, '2015-12-18 10:30:00', '2015-12-18 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '一一踢腿意识很强啦，做了试水反应，在有新小朋友的情况下都带头给小朋友做示范跳水。跳的很棒敢双脚离地。踢腿意识很好。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝祎（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(513, 368, '2015-12-18', NULL, '2015-12-18 10:30:00', '2015-12-18 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小满喜欢水，以前有玩水的基础，在水中放的开，试水反应没问题，踢腿的意识是有，但是极为不标准，需要教其标准动作，跳水也没问题。', 1, '教学课程', NULL, NULL, 164, '1115', NULL, '2013-02-07', '邓昊泽', '男', '南昌市', NULL, 'B2', NULL),
	(515, 372, '2015-12-18', NULL, '2015-12-18 11:00:00', '2015-12-18 11:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '穰穰今天的表现非常的让人惊讶。唱完开场歌后就蹬水蹬个不停啦。而且还在不停的开心的学语。总之今天状态非常的好。', 1, '教学课程', NULL, NULL, 132, '027', NULL, '2015-02-28', '程鸣谦（穰穰）', '女', '红谷滩', NULL, 'A2', NULL),
	(516, 380, '2015-12-18', NULL, '2015-12-18 15:00:00', '2015-12-18 15:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天子聪的状态很好，下水就开始踢水，试水的时候有些张嘴巴，时好时坏。现在跳水之后马上腿就开始踢水了，潜水了，没呛到也没哭。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(517, 396, '2015-12-18', NULL, '2015-12-18 17:00:00', '2015-12-18 17:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，天恩的腿踢的不错，由于妈妈前两次执意给天恩潜水，现在练试水都不愿意了，不过跳水还可以。', 1, '教学课程', NULL, NULL, 199, '040', NULL, '2013-03-08', '陈添恩', '女', '民德路民巷', NULL, 'B2', NULL),
	(518, 396, '2015-12-18', NULL, '2015-12-18 17:00:00', '2015-12-18 17:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，哈密今天的表现不错，蹬腿意识很好，试水也不错，带他潜水了，效果不错很好，跳水还是有点胆小，不敢站立跳。', 1, '教学课程', NULL, NULL, 214, '1157', NULL, '2013-02-22', '张艺恺', '男', '', NULL, 'B2', NULL),
	(520, 400, '2015-12-18', NULL, '2015-12-18 17:40:00', '2015-12-18 18:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '圆圆目前的情况可以潜水，但是不敢，心里还是很抗拒。要多做开导。', 1, '教学课程', NULL, NULL, 20, '001', NULL, '2011-08-09', '李思源（圆圆）', '男', '滨江豪园', NULL, 'C1', NULL),
	(521, 400, '2015-12-18', NULL, '2015-12-18 17:40:00', '2015-12-18 18:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '果果今天的表现不太好，妈妈在给她做试水反应的时候一次性浇的时间过长，导致后面上课的状态越来越差。', 1, '教学课程', NULL, NULL, 159, '024', NULL, '2012-04-29', '喻路丹（果果）', '女', '联发融德', NULL, 'C1', NULL),
	(522, 400, '2015-12-18', NULL, '2015-12-18 17:40:00', '2015-12-18 18:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '凡凡今天的表现很随意，想做什么就做什么，胆子还要在大一点，妈妈比较腼腆，不怎么说话。', 1, '教学课程', NULL, NULL, 275, '1210', NULL, '2012-12-10', '周超凡（凡凡）', '男', '', NULL, 'C1', NULL),
	(523, 433, '2015-12-19', NULL, '2015-12-19 16:00:00', '2015-12-19 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '圆圆今天完全适应了耳朵入水，吐泡泡也很随意能够完成，而且能够吐7秒钟。跳水也敢于跳的很高，很远。试水反应能够浇水3秒。', 1, '教学课程', NULL, NULL, 20, '001', NULL, '2011-08-09', '李思源（圆圆）', '男', '滨江豪园', NULL, 'C1', NULL),
	(524, 433, '2015-12-19', NULL, '2015-12-19 16:00:00', '2015-12-19 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '雨欣这节课没有和我们一起上，她很害羞，爸爸执意要带她自己玩儿。', 1, '教学课程', NULL, NULL, 196, '1141', NULL, '2010-11-12', '刘雨欣', '女', '', NULL, 'C1', NULL),
	(526, 408, '2015-12-19', NULL, '2015-12-19 10:00:00', '2015-12-19 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，今天奇奇状态很不好，下了两次水还是哭的很凶。所有玩具都给了还是哭啊，妈妈后面也进来了，妈妈一抱就好了。后面还是上去了。', 1, '教学课程', NULL, NULL, 114, '046', NULL, '2015-07-04', '李雯妤奇奇', '女', '红谷春天花园', NULL, 'A2', NULL),
	(527, 412, '2015-12-19', NULL, '2015-12-19 10:30:00', '2015-12-19 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天乐儿表现还可以，他现在喜欢正面游泳，不喜欢仰漂了。用玩具吸引她的注意力，仰漂的时候还可以，但是还是有些小紧张。', 1, '教学课程', NULL, NULL, 231, '045', NULL, '2015-07-13', '徐歆蕾（乐儿）', '女', '', NULL, 'A1', NULL),
	(528, 416, '2015-12-19', NULL, '2015-12-19 11:00:00', '2015-12-19 11:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '牛牛的动作没有什么大问题，但是小细节做的不好，动作偏软，上课有时候容易开小差，认真一点的话进步会更大。', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(529, 416, '2015-12-19', NULL, '2015-12-19 11:00:00', '2015-12-19 11:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '乐乐的动作很僵硬，因为太久没来了有点找不到感觉。上课也不太认真', 1, '教学课程', NULL, NULL, 200, '041', NULL, '2009-11-02', '朱思远', '男', '万科四季花城小区', NULL, 'C1', NULL),
	(531, 425, '2015-12-19', NULL, '2015-12-19 15:00:00', '2015-12-19 15:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '皓皓来的比较晚，刚下水的时候有点不适应，后面就越来越好，试水反应很好，坚持三四节课之后就能潜水了。', 1, '教学课程', NULL, NULL, 277, '063', NULL, '2015-02-28', '章嘉皓', '男', '', NULL, 'A1', NULL),
	(532, 425, '2015-12-19', NULL, '2015-12-19 15:00:00', '2015-12-19 15:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '一一今天的表现非常好，完成了一次潜水，非常有潜力的宝宝', 1, '教学课程', NULL, NULL, 216, '042', NULL, '2015-09-13', '夏霁然一一', '女', '保利', NULL, 'A1', NULL),
	(534, 429, '2015-12-19', NULL, '2015-12-19 15:30:00', '2015-12-19 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '龙龙很怕水，基本是爸爸在一旁带着玩儿。妈妈带弟弟先下水，后来就一起玩儿，只敢趴在爸爸肩膀上，换个姿势就哭。', 1, '教学课程', NULL, NULL, 279, '1212', NULL, '2013-12-04', '董乐山', '男', '', NULL, 'B2', NULL),
	(535, 429, '2015-12-19', NULL, '2015-12-19 15:30:00', '2015-12-19 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬注意力有些不集中，喜欢到处要东西了。踢腿意识也是不强。试水反应看到杯子就会清楚说不要。就是很喜欢跳水。', 1, '教学课程', NULL, NULL, 182, '028', NULL, '2014-03-16', '黄昱彬（彬彬）', '女', '', NULL, 'B1', NULL),
	(537, 437, '2015-12-19', NULL, '2015-12-19 16:30:00', '2015-12-19 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '雅西迟到了，基本没怎么上课，外婆要求自己玩儿会儿，宝宝非常喜欢水，在水中笑的也很开心。外婆比妈妈都有意识，敢于大胆的做仰漂，而且水入耳朵也不会担心。', 1, '教学课程', NULL, NULL, 176, '1126', NULL, '2013-12-31', '邹雅西', '男', '', NULL, 'A1', NULL),
	(538, 437, '2015-12-19', NULL, '2015-12-19 16:30:00', '2015-12-19 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小c是很不受控制，声音必须很大才能有点效果，踢腿勉强一阵一阵的能踢好。试水反应也是勉强浇上去就哄哄，慢慢就好点。', 1, '教学课程', NULL, NULL, 171, '1121', NULL, '2013-12-31', '叶长曦', '男', '', NULL, 'C1', NULL),
	(540, 441, '2015-12-19', NULL, '2015-12-19 17:00:00', '2015-12-19 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '龙龙第一次带，爸爸带下水，试水反应能够完成，爸爸说其在外面泳池玩过水，我也对其做了表扬，跳水也敢跳起来。', 1, '教学课程', NULL, NULL, 280, '1213', NULL, '2013-06-17', '李梓轩（龙龙）', '男', '', NULL, 'B2', NULL),
	(541, 441, '2015-12-19', NULL, '2015-12-19 17:00:00', '2015-12-19 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '哈密试水没问题，踢腿意识很好。妈妈带下水对于他的要求会比较高。', 1, '教学课程', NULL, NULL, 214, '1157', NULL, '2013-02-22', '张艺恺', '男', '', NULL, 'B2', NULL),
	(542, 441, '2015-12-19', NULL, '2015-12-19 17:00:00', '2015-12-19 18:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小宇很大胆，玩儿的比较嗨。潜水什么的都没问题，试水反应三秒钟没问题。跳水也敢大胆的跳起来。踢腿意识也很棒。', 1, '教学课程', NULL, NULL, 173, '1123', NULL, '2013-12-31', '叶禹浩', '男', '', NULL, 'B2', NULL),
	(543, 494, '2015-12-19', '', '2015-12-19 15:15:00', '2015-12-19 15:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '兜兜比较胆小，整堂课基本是没上内容，随时是哭一会儿好一会儿。上不了课，妈妈也很愿意第一次让其再缓缓，让妈妈带其四处飘一会儿。直到下课才敢自己抓东西玩。', 1, '教学课程', NULL, NULL, 276, '064', NULL, '2015-02-28', '蔡厚泽（兜兜）', '男', '', NULL, 'A1', NULL),
	(544, 494, '2015-12-19', '', '2015-12-19 15:15:00', '2015-12-19 15:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '楷楷是很怕水的，到水里了紧张的直发抖。而且看到球都不敢抓。也是妈妈带宝宝四处飘，宝宝只敢趴在妈妈肩膀上，换个姿势都哭。一直飘到下课。', 1, '教学课程', NULL, NULL, 278, '1211', NULL, '2015-01-31', '董乐楷（楷楷）', '男', '', NULL, 'A2', NULL),
	(546, 461, '2015-12-20', NULL, '2015-12-20 11:00:00', '2015-12-20 11:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '毛申辰水性很好，踢腿意识也很好，踢腿踢得也很棒。进步很快，教一次就能够学会。试水反应很好。', 1, '教学课程', NULL, NULL, 281, '1214', NULL, '2012-12-21', '毛申辰', '男', '', NULL, 'C1', NULL),
	(547, 492, '2015-12-20', NULL, '2015-12-20 11:05:00', '2015-12-20 12:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '子墨刚下水的时候有一点紧张，后面上课的状态越来越好，希望这种状态能继续保持。', 1, '教学课程', NULL, NULL, 36, '018', NULL, '2010-05-13', '万子墨（Andy）', '男', '南昌莲塘', NULL, 'C1', NULL),
	(548, 492, '2015-12-20', NULL, '2015-12-20 11:05:00', '2015-12-20 12:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '牛牛今天的表现一般，上课的状态很散漫，要时时刻刻盯着他，才游的好一点。', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(549, 492, '2015-12-20', NULL, '2015-12-20 11:05:00', '2015-12-20 12:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '乐乐容易开小差，还没有找到在水里打腿的感觉，还要继续加油', 1, '教学课程', NULL, NULL, 200, '041', NULL, '2009-11-02', '朱思远', '男', '万科四季花城小区', NULL, 'C1', NULL),
	(550, 492, '2015-12-20', NULL, '2015-12-20 11:05:00', '2015-12-20 12:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '豆豆每次上课的状态都是心不在焉不知道在想什么，动作做的很软。自由泳腿还要多巩固。', 1, '教学课程', NULL, NULL, 234, '039', NULL, '2010-08-31', '李贤一（豆豆）', '男', '', NULL, 'C1', NULL),
	(554, 453, '2015-12-20', NULL, '2015-12-20 10:00:00', '2015-12-20 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '小小的进步越来越大，潜水都不哭了，接下来就是要加深潜水深度和时间', 1, '教学课程', NULL, NULL, 22, '003', NULL, '2015-04-19', '万子瑜小小', '男', '南昌红谷滩', NULL, 'A1', NULL),
	(555, 453, '2015-12-20', NULL, '2015-12-20 10:00:00', '2015-12-20 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '果果今天的表现也很好，潜了一次水，希望这种状态能继续保持下去。', 1, '教学课程', NULL, NULL, 213, '1156', NULL, '2014-09-27', '祝沛涵', '男', '', NULL, 'B1', NULL),
	(557, 457, '2015-12-20', NULL, '2015-12-20 10:30:00', '2015-12-20 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '小满其他环节表现的都很不错，但是不愿意潜水，姥爷也不强求。还是要妈妈带下水。', 1, '教学课程', NULL, NULL, 35, '019', NULL, '2013-12-24', '袁晨硕(小满）', '男', '南昌世茂', NULL, 'B1', NULL),
	(558, 457, '2015-12-20', NULL, '2015-12-20 10:30:00', '2015-12-20 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '松松今天刚下水的时候没有进入状态，是一个上课比较平静的宝宝，对试水反应有一点抗拒', 1, '教学课程', NULL, NULL, 255, '1191', NULL, '2014-04-12', '毛彦松（松松）', '男', '', NULL, 'A2', NULL),
	(560, 465, '2015-12-20', NULL, '2015-12-20 14:30:00', '2015-12-20 15:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '满满今天状态没有以往状态好，上到二十分钟的时候就有点不耐烦，想一直往妈妈身上靠了。试水反应做了，跳水有点不耐烦。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(561, 469, '2015-12-20', NULL, '2015-12-20 15:00:00', '2015-12-20 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '可乐表现的挺好的。能够完成试水反应，踢腿意识算是比较好的了，吐泡泡有意识会张嘴去水中吐。', 1, '教学课程', NULL, NULL, 264, '1200', NULL, '2014-03-18', '史泽明（cola）', '女', '', NULL, 'A1', NULL),
	(562, 469, '2015-12-20', NULL, '2015-12-20 15:00:00', '2015-12-20 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '利利迟到了25分钟，基本没上什么课，下水的时候做到了试水反应。她能够做完，妈妈带着她。', 1, '教学课程', NULL, NULL, 265, '053', NULL, '2014-01-22', '张以雯利利', '女', '省政府', NULL, 'B1', NULL),
	(563, 469, '2015-12-20', NULL, '2015-12-20 15:00:00', '2015-12-20 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '乐乐迟到了25分钟下水的时候做到了试水反应。试水反应能够做完， 妈妈给他做了一次潜水。他完全没问题。', 1, '教学课程', NULL, NULL, 266, '053-1', NULL, '2014-01-22', '张以礼乐乐', '男', '省政府', NULL, 'B1', NULL),
	(564, 469, '2015-12-20', NULL, '2015-12-20 15:00:00', '2015-12-20 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '多多今天状态不好，上了大概十分钟就有点什么都不想要了，到了跳水的环节就好了。踢腿意识不强，试水反应能够做到。', 1, '教学课程', NULL, NULL, 226, '1169', NULL, '2014-01-01', '多多', '男', '', NULL, 'B1', NULL),
	(568, 473, '2015-12-20', NULL, '2015-12-20 15:30:00', '2015-12-20 16:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，俊俊下水之后很淡定，给他做仰漂还是很放松的漂着，试水也不错，很好。', 1, '教学课程', NULL, NULL, 282, '1215', NULL, '2015-08-05', '魏张峻', '男', '', NULL, 'A1', NULL),
	(569, 473, '2015-12-20', NULL, '2015-12-20 15:30:00', '2015-12-20 16:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，萌萌很喜欢用手打水，但是正面游泳的时候，她下巴会突然往下趴，踢腿意识还可以。试水有些紧张。', 1, '教学课程', NULL, NULL, 167, '1117', NULL, '2015-03-16', '刘涵予（萌萌）', '男', '南昌市顺外路', NULL, 'A2', NULL),
	(571, 488, '2015-12-20', NULL, '2015-12-20 17:00:00', '2015-12-20 17:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，乐乐胆子很小，做什么都要跟她说好久，做示范也要很久，她才可以试试去做下，但是效果都很好。', 1, '教学课程', NULL, NULL, 285, '1218', NULL, '2013-01-26', '赵心妤', '男', '', NULL, 'B2', NULL),
	(572, 488, '2015-12-20', NULL, '2015-12-20 17:00:00', '2015-12-20 17:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，多多表现的很好，可以闷气漂浮，但是腿打的不怎么好，', 1, '教学课程', NULL, NULL, 284, '1217', NULL, '2010-01-08', '左浩轩', '男', '', NULL, 'C1', NULL),
	(573, 488, '2015-12-20', NULL, '2015-12-20 17:00:00', '2015-12-20 17:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，涵涵蹬腿意识不错，也比较喜欢踢水，试水刚开始不愿意但后面就好了，跳水胆子有点小，不敢站立跳。', 1, '教学课程', NULL, NULL, 283, '1216', NULL, '2011-03-07', '董雨涵', '男', '', NULL, 'C1', NULL),
	(574, 488, '2015-12-20', NULL, '2015-12-20 17:00:00', '2015-12-20 17:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，今天彬彬表现很好，踢腿很积极，现在试水很喜欢，自己都给自己浇水，吐泡泡也很好，跟爸爸商量了，让他潜水，最后潜水了，没有呛水，就哭了一下。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
	(575, 260, '2015-12-23', NULL, '2015-12-23 11:00:00', '2015-12-23 12:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天穰穰变现的很好，一下水就很兴奋，但是腿没有上节课踢的勤奋，今天状态好，给她做了试水，效果不错。跳水也很喜欢。', 1, '教学课程', NULL, NULL, 132, '027', NULL, '2015-02-28', '程鸣谦（穰穰）', '女', '红谷滩', NULL, 'A2', NULL),
	(576, 250, '2015-12-23', NULL, '2015-12-23 10:00:00', '2015-12-23 10:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，由于爸爸第一次带多多，就从最基础的姿势开始联系，爸爸也很配合，今天多多踢水有点进步，能主动踢几次，试水很好，给她潜水了，效果也不错，没呛水。跳水主动意识还好。', 1, '教学课程', NULL, NULL, 230, '048', NULL, '2014-11-23', '杨欣语（朵朵）', '女', '绿地', NULL, 'B1', NULL),
	(577, 255, '2015-12-23', NULL, '2015-12-23 10:30:00', '2015-12-23 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，刚开始下水还是会哭，不过妈妈的安抚和玩具的诱惑就好了，但是不能融入到上课的气氛中，对陌生面孔有点恐惧，试水还不错。', 1, '教学课程', NULL, NULL, 116, '1075', NULL, '2014-12-02', '郭扬铭', '女', '南昌朝阳大桥', NULL, 'A2', NULL),
	(578, 255, '2015-12-23', NULL, '2015-12-23 10:30:00', '2015-12-23 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天一一表现很好，腿踢的还需努力，现在试水不哭了，也做了跳潜和传递潜，也没哭，效果都很好。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝祎（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(579, 255, '2015-12-23', NULL, '2015-12-23 10:30:00', '2015-12-23 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，潇潇现在有点不受控制，但是踢腿不错，试水和跳水也好，今天跳潜转身了，自己也能游一小段距离。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市洪城比华利', NULL, 'B2', NULL),
	(580, 255, '2015-12-23', NULL, '2015-12-23 10:30:00', '2015-12-23 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，一好还是胆子比较小，大腿的是双脚同时蹬的，试水现在很好，但是不愿潜水，在妈妈的要求下也给他潜水了，效果不错，不会呛水。跳水不敢站立跳。', 1, '教学课程', NULL, NULL, 190, '033', NULL, '2013-08-16', '王恩哲一好', '男', '红谷滩新地阿尔法', NULL, 'B2', NULL),
	(581, 255, '2015-12-23', NULL, '2015-12-23 10:30:00', '2015-12-23 11:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，吐吐变现的很好，蹬腿主动意识很强，试水也不错，跳水不敢站立跳，给他潜水了，出水的时候有些紧张。', 1, '教学课程', NULL, NULL, 273, '062', NULL, '2012-10-19', '陈炳照（吐吐）', '男', '万达星城', NULL, 'C1', NULL),
	(584, 280, '2015-12-23', NULL, '2015-12-23 16:30:00', '2015-12-23 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '苗苗因为迟到了，也和其他小朋友年龄差距大，整节课基本是让苗苗和妈妈自己玩，做到试水反应，跳水，仰漂的时候才来让苗苗做，苗苗做了试水反应，没问题。仰漂也在慢慢适应，', 1, '教学课程', NULL, NULL, 21, '002', NULL, '2015-03-17', '李仁一（苗苗）', '男', '江西省体育局宿舍', NULL, 'A2', NULL),
	(585, 280, '2015-12-23', NULL, '2015-12-23 16:30:00', '2015-12-23 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '童童是比较厉害的潜水早就学会了，现在在加强练习吐泡泡及练习肺活量。让其吹小球。', 1, '教学课程', NULL, NULL, 175, '032', NULL, '2013-12-31', '余梓睿桐桐', '男', '', NULL, 'B2', NULL),
	(586, 280, '2015-12-23', NULL, '2015-12-23 16:30:00', '2015-12-23 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小布踢腿意识蛮强，就是动作需要完善，试水反应能够良好的完成，跳水暂时还不敢站着跳。', 1, '教学课程', NULL, NULL, 164, '1115', NULL, '2013-02-07', '邓昊泽', '男', '南昌市', NULL, 'B2', NULL),
	(587, 295, '2015-12-23', NULL, '2015-12-23 17:40:00', '2015-12-23 18:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '兜兜表现的还蛮好的，爸爸时常带她自己玩、她吐泡泡能够非常棒的完成，骑小毛驴的时候能够一边嘴巴入水，起来换气，继续下去、。', 1, '教学课程', NULL, NULL, 207, '037', NULL, '2013-12-08', '万周乐窈（兜兜）', '女', '万达华府景园', NULL, 'B2', NULL),
	(588, 295, '2015-12-23', NULL, '2015-12-23 17:40:00', '2015-12-23 18:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', 'celia今天表现一般，踢腿是所有小朋友踢的最好的。今天有点害羞，试水反应没有做。跳水也没有做。自己都不愿意去做。', 1, '教学课程', NULL, NULL, 23, '004', NULL, '2011-11-22', '程芷莹（Celia）', '女', '保利高尔夫花园', NULL, 'C1', NULL),
	(589, 295, '2015-12-23', NULL, '2015-12-23 17:40:00', '2015-12-23 18:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬爸爸今天可能遇到不开心的事情了。下水就不怎么说话，下水后彬彬也不愿动爸爸问他他也不回答，然后就上去了，。下水不到五分钟。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
	(590, 295, '2015-12-23', NULL, '2015-12-23 17:40:00', '2015-12-23 18:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '果果今天爸妈都没下水。james带下水的，果果是表现的最好的，踢腿意识很好，也能够很好的把腿踢直。试水反应不愿意我浇，敢自己慢慢浇一点，。', 1, '教学课程', NULL, NULL, 159, '024', NULL, '2012-04-29', '喻路丹（果果）', '女', '联发融德', NULL, 'C1', NULL),
	(591, 295, '2015-12-23', NULL, '2015-12-23 17:40:00', '2015-12-23 18:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '饺子还是很不受控制。爸爸对他有要求了，他不听话爸爸就把他往水里按，效果还不错，他也不会很排斥爸爸按他入水，他也没呛水的迹象。他自己说宁可下水里也不敢站着跳水。', 1, '教学课程', NULL, NULL, 177, '061', NULL, '2013-01-01', '吴泊然饺子', '男', '', NULL, 'C1', NULL),
	(594, 290, '2015-12-23', NULL, '2015-12-23 17:40:00', '2015-12-23 18:40:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '军军现在上课比较认真，琪琪现在上课很不自觉，一直要人盯着。总体来说都有进步', 1, '教学课程', NULL, NULL, 122, '025', NULL, '2007-12-21', '刘彦军/刘子琪', '男', '海波澜庭', NULL, 'C1', NULL),
	(595, 305, '2015-12-24', NULL, '2015-12-24 10:00:00', '2015-12-24 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '萱萱今天表现有一点进步，但是上课的时候还不是很专心，完成了一次潜水。希望下一节课能继续保持这种状态。', 1, '教学课程', NULL, NULL, 71, '029', NULL, '2013-11-07', '杜雅萱', '女', '南昌市', NULL, 'B1', NULL),
	(596, 305, '2015-12-24', NULL, '2015-12-24 10:00:00', '2015-12-24 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '潇潇今天表现的很好，现在在学跳水转身，还不是很连贯，还要继续加油。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市洪城比华利', NULL, 'B2', NULL),
	(598, 310, '2015-12-24', NULL, '2015-12-24 10:30:00', '2015-12-24 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '开心现在腿打的越来越好了，但是潜水的时候还有点紧张，总体表现还是不错的。', 1, '教学课程', NULL, NULL, 212, '034', NULL, '2013-04-30', '朱恩禧开心', '女', '', NULL, 'B2', NULL),
	(599, 310, '2015-12-24', NULL, '2015-12-24 10:30:00', '2015-12-24 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '迪迪妈妈下水的时候非常紧张，迪迪却很放松，妈妈等下课的时候才慢慢放松，希望后面的课能越来越好。', 1, '教学课程', NULL, NULL, 302, '1235', NULL, '2014-02-27', '段浩轩', '男', '', NULL, 'B1', NULL),
	(601, 315, '2015-12-24', NULL, '2015-12-24 11:00:00', '2015-12-24 11:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '赳赳一下水就哭闹，什么都不敢做，但是潜了两次水，还要让他慢慢适应这个场馆。', 1, '教学课程', NULL, NULL, 245, '047', NULL, '2013-06-29', '熊吕和赳赳', '男', '联泰香域滨江', NULL, 'B2', NULL),
	(602, 335, '2015-12-24', NULL, '2015-12-24 16:00:00', '2015-12-24 16:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '利利今天表现不错，试水反应不错，能够浇水3秒，踢腿意识差了点，但是吐泡泡是出奇的好。能够吐十秒。', 1, '教学课程', NULL, NULL, 265, '053', NULL, '2014-01-22', '张以雯利利', '女', '省政府', NULL, 'B1', NULL),
	(603, 340, '2015-12-24', NULL, '2015-12-24 16:30:00', '2015-12-24 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '乐乐今天有点离不开妈妈，下水就一直要抱，不敢离开妈妈。就直接趴在妈妈的肩膀上踢腿，踢腿是出奇的好，能够一直坚持不间断的踢腿。妈妈说这俩小孩以前小时候就开始玩水，而且以前潜水都很棒。需要慢慢适应。', 1, '教学课程', NULL, NULL, 266, '053-1', NULL, '2014-01-22', '张以礼乐乐', '男', '省政府', NULL, 'B1', NULL),
	(604, 345, '2015-12-24', NULL, '2015-12-24 17:00:00', '2015-12-24 17:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '辰辰今天爸爸带下水，踢腿意识不好，基本不怎么踢腿，加强了踢腿练习还是没什么效果，跟爸爸说了如果宝宝想进步快点，是需要在家也练习踢腿的，试水反应能够完成，没有问题。吐泡泡不敢吐，需要加强练习。', 1, '教学课程', NULL, NULL, 232, '038', NULL, '2012-04-23', '林羽辰（辰辰）', '男', '', NULL, 'C1', NULL),
	(605, 325, '2015-12-24', NULL, '2015-12-24 15:00:00', '2015-12-24 15:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，嘉乐的表现不错，蹬腿的意识有但是不明显，还需加油，试水不错，给他潜水了，效果也还好。比较听话。', 1, '教学课程', NULL, NULL, 189, '031', NULL, '2013-11-13', '陈嘉乐', '男', '', NULL, 'B2', NULL),
	(606, 330, '2015-12-24', NULL, '2015-12-24 15:30:00', '2015-12-24 16:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '嘉宇今天的表现不错，刚开始下水有点不会了，是因为有蛮久没来了，让他趴在浮板上打腿了，之后拿浮漂打腿，蛮好，这节课给他徒手打腿了，能自己打腿前进泳池三分之二的距离。下节课可以练习手臂了。', 1, '教学课程', NULL, NULL, 189, '031', NULL, '2013-11-13', '陈嘉乐', '男', '', NULL, 'B2', NULL),
	(607, 369, '2015-12-25', NULL, '2015-12-25 10:30:00', '2015-12-25 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '潇潇随意潜水，踢腿意识很好，试水反应没问题。跳潜也能够很好的完成。', 1, '教学课程', NULL, NULL, 59, '021', NULL, '2013-06-19', '朱潇怡潇潇', '女', '南昌市洪城比华利', NULL, 'B2', NULL),
	(608, 369, '2015-12-25', NULL, '2015-12-25 10:30:00', '2015-12-25 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '一一现在潜水也能够完成，不会哭了，已经适应了潜水的过程。踢腿意识不错，跳水比较胆大。', 1, '教学课程', NULL, NULL, 136, '023', NULL, '2013-12-27', '柯朝祎（一一）', '男', '红谷滩飞虹路69号', NULL, 'B1', NULL),
	(609, 369, '2015-12-25', NULL, '2015-12-25 10:30:00', '2015-12-25 11:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小布有点弱，踢腿意识有点差，吐泡泡勉强能够完成，跳水勉强能站着跳。还需要加强练习，应该有好的进步。', 1, '教学课程', NULL, NULL, 164, '1115', NULL, '2013-02-07', '邓昊泽', '男', '南昌市', NULL, 'B2', NULL),
