	(617, 393, '2015-12-25', NULL, '2015-12-25 16:30:00', '2015-12-25 17:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，歆然表现很好，踢腿不错，试水也还好，妈妈也很配合，第一节课就能吐泡泡了。跳水也敢站立跳，是个好苗子。', 1, '教学课程', NULL, NULL, 305, '1238', NULL, '2013-05-11', '涂歆然', '女', '', NULL, 'B2', NULL),
