	(719, 542, '2016-01-03', '', '2016-01-03 10:30:00', '2016-01-03 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '文浩年龄偏大，所以在水里适应的很快。能闷气就可以开始学游泳了。', 1, '教学课程', NULL, NULL, 334, '1261', NULL, '2013-03-09', '李文浩', '男', '', NULL, 'B2', NULL),
