	(725, 558, '2016-01-03', '', '2016-01-03 14:30:00', '2016-01-03 15:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小小今天状态不错，喜欢躺着踢腿。踢得很好，很欢快，速度踢得也很均匀，就是对试水反应时非常的不喜欢，今天比较喜欢躺着。妈妈对宝宝这么棒的踢腿表示很开心。', 1, '教学课程', NULL, NULL, 22, '003', NULL, '2015-04-19', '万子瑜小小', '男', '南昌红谷滩', NULL, 'A1', NULL),
	(726, 563, '2016-01-03', '', '2016-01-03 15:00:00', '2016-01-03 15:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '可乐今天踢腿意识很好。吐泡泡就快要成功了。有大口往里吸气的意识。跳水还不行。胆子还有点小。试水反应还是有点恐惧。', 1, '教学课程', NULL, NULL, 264, '1200', NULL, '2014-03-18', '史泽明（cola）', '女', '', NULL, 'A1', NULL),
