	(728, 547, '2016-01-03', '', '2016-01-03 10:40:00', '2016-01-03 11:10:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，mitch刚下水的表现很好，吐泡泡很好现在，蹬腿还是不怎么好，试水会哭，今天潜水了，效果不错。', 1, '教学课程', NULL, NULL, 179, '1128', NULL, '2013-12-31', 'Mitch', '男', '', NULL, 'A1', NULL),
