	(763, 679, '2016-01-07', '', '2016-01-07 17:00:00', '2016-01-07 17:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '嘉乐今天玩得很开心，上课的时候哥哥都在一旁玩。给其做了示范，跳水跳的很好，因为哥哥给做了示范，妈妈很惊讶佳乐能够做到这么棒。试水反应一般。', 1, '教学课程', NULL, NULL, 189, '031', NULL, '2013-11-13', '陈嘉乐', '男', '', NULL, 'B2', NULL),
	(764, 679, '2016-01-07', '', '2016-01-07 17:00:00', '2016-01-07 17:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬今天状态一般，有些时间没来了，踢腿意识还行，就是没有以前的标准了，爸爸也发现他的踢腿动作没以前标准。试水反应不错，可以自己浇水了。', 1, '教学课程', NULL, NULL, 124, '026', NULL, '2012-10-24', '袁彬彬', '男', '凤凰洲', NULL, 'C1', NULL),
	(766, 671, '2016-01-07', '', '2016-01-07 16:00:00', '2016-01-07 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '嘉宇今天状态不错，踢腿踢得一流的好，没有之一。憋气是很能憋，现在就是需要加强他自己换气的能力。迈出那一步就很好了。', 1, '教学课程', NULL, NULL, 189, '031', NULL, '2013-11-13', '陈嘉乐', '男', '', NULL, 'B2', NULL),
	(768, 643, '2016-01-07', '', '2016-01-07 10:00:00', '2016-01-07 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '修齐早上的状态没有下午的好，随着年龄的增大自我保护意识越来越强，再加上太久没有来，上课的时候不在状态，做试水反应现在有一些抗拒', 1, '教学课程', NULL, NULL, 135, '044', NULL, '2015-01-06', '李修齐', '男', '南昌市', NULL, 'A2', NULL),
	(769, 643, '2016-01-07', '', '2016-01-07 10:00:00', '2016-01-07 10:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '小猴子表现的非常不错，很淡定。下一堂课可以潜水了', 1, '教学课程', NULL, NULL, 333, '1260', NULL, '2014-07-22', '梅誉航（小猴子）', '男', '洪城', NULL, 'B1', NULL),
	(771, 647, '2016-01-07', '', '2016-01-07 10:30:00', '2016-01-07 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '赳赳下水前就一直不停的哭闹，上课的时候必须要去引导，慢慢来。', 1, '教学课程', NULL, NULL, 245, '047', NULL, '2013-06-29', '熊吕和赳赳', '男', '联泰香域滨江', NULL, 'B2', NULL),
	(772, 683, '2016-01-07', '', '2016-01-07 17:30:00', '2016-01-07 18:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '军军琪琪今天的表现还不错，军军下一节课可以学习仰泳了，琪琪可以学换气了', 1, '教学课程', NULL, NULL, 122, '025', NULL, '2007-12-21', '刘彦军/刘子琪', '男', '海波澜庭', NULL, 'C1', NULL),
	(773, 691, '2016-01-08', '', '2016-01-08 10:00:00', '2016-01-08 10:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '天天今天第一次来，对于水，其非常的喜欢，胆子也比较大。踢腿意识因为第一次来还需要加强。', 1, '教学课程', NULL, NULL, 338, '1263', NULL, '2014-04-02', '李东良', '男', '', NULL, 'B1', NULL),
	(774, 691, '2016-01-08', '', '2016-01-08 10:00:00', '2016-01-08 10:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '萱萱今天表现还行，试水反应有点紧张，但是能够做完。踢腿意识还可以。妈妈觉得相比以前这次有点退步。需要多多练习。', 1, '教学课程', NULL, NULL, 71, '029', NULL, '2013-11-07', '杜雅萱', '女', '南昌市', NULL, 'B1', NULL),
	(775, 691, '2016-01-08', '', '2016-01-08 10:00:00', '2016-01-08 10:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '一好现在玩的很驾轻就熟了，吐泡泡是他的强项，试水反应完全没问题，自己浇都可以做到，跳水也可以做到。踢腿 踢得很好，意识很强。', 1, '教学课程', NULL, NULL, 190, '033', NULL, '2013-08-16', '王恩哲一好', '男', '红谷滩新地阿尔法', NULL, 'B2', NULL),
	(776, 695, '2016-01-08', '', '2016-01-08 11:00:00', '2016-01-08 11:30:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '赳赳踢腿意识很好，虽然对水有恐惧，但是下水后经过很久的安抚最后才做到了。下水玩的还不错，踢腿意识很好，试水反应也做的比较好。可以自己浇。吐泡泡还需要练习。', 1, '教学课程', NULL, NULL, 245, '047', NULL, '2013-06-29', '熊吕和赳赳', '男', '联泰香域滨江', NULL, 'B2', NULL),
	(777, 699, '2016-01-08', '', '2016-01-08 14:30:00', '2016-01-08 15:00:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天满满表现的很好，从一下水就很活跃，现在后仰蹬腿不错，试水会张嘴巴，但是会把水吐了，潜水了，出水的一瞬间还是会很紧张，跳水很活跃。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(778, 711, '2016-01-08', '', '2016-01-08 16:00:00', '2016-01-08 16:30:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '妈妈带下水，今天嚷嚷表现不错，蹬腿的意识越来越明显了，现在喜欢侧躺在水面上，试水不错，今天做了传递潜，效果也很好。', 1, '教学课程', NULL, NULL, 132, '027', NULL, '2015-02-28', '程鸣谦（穰穰）', '女', '红谷滩', NULL, 'A2', NULL),
	(779, 642, '2016-01-07', '', '2016-01-08 09:30:00', '2016-01-08 10:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '牛牛今天的表现一般，太容易开小差了。上课的情绪不高。', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(780, 651, '2016-01-07', '', '2016-01-08 11:00:00', '2016-01-08 11:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '圆圆今天表现的一般，没什么太大的突破。', 1, '教学课程', NULL, NULL, 20, '001', NULL, '2011-08-09', '李思源（圆圆）', '男', '滨江豪园', NULL, 'C1', NULL),
	(781, 651, '2016-01-07', '', '2016-01-08 11:00:00', '2016-01-08 11:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '芷莹今天的表现有一点进步，敢全部躺在水面上，用杯子浇水洗脸。', 1, '教学课程', NULL, NULL, 23, '004', NULL, '2011-11-22', '程芷莹（Celia）', '女', '保利高尔夫花园', NULL, 'C1', NULL),
	(782, 651, '2016-01-07', '', '2016-01-08 11:00:00', '2016-01-08 11:45:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '添恩上课的时候注意力不集中，容易被小东西吸引注意力。', 1, '教学课程', NULL, NULL, 199, '040', NULL, '2013-03-08', '陈添恩', '女', '民德路民巷', NULL, 'B2', NULL),
	(783, 497, '2016-01-09', NULL, '2016-01-09 11:00:00', '2016-01-09 11:45:00', 11, 'James', '周建', '15797780013', NULL, 'YL19931222', '150814', '爸爸带下水，六宝今天的状态很不好，一点也不听话，可能是没有小伙伴一起上课的原因，让他趴在浮板上打腿根本就不打，趴在爸爸的肩膀上也是一样很懒，不愿意踢腿，试水和跳水不错，今天潜水也很好。希望下次把他排在有同伴一起上课。', 1, '教学课程', NULL, NULL, 195, '1140', NULL, '2013-06-16', '刘子瑀（六宝）', '男', '红谷滩', NULL, 'B2', NULL),
	(784, 502, '2016-01-09', NULL, '2016-01-09 11:10:00', '2016-01-09 12:10:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '乐乐的腿踢得还是没有什么感觉，要多多找感觉，', 1, '教学课程', NULL, NULL, 200, '041', NULL, '2009-11-02', '朱思远', '男', '万科四季花城小区', NULL, 'C1', NULL),
	(785, 517, '2016-01-09', NULL, '2016-01-09 15:30:00', '2016-01-09 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '彬彬今天姥姥带下水，变现的比较好，踢腿意识比以前略有进步，吹泡泡有意识去吹了，。小女生还是太温柔的感觉，运动量很小。', 1, '教学课程', NULL, NULL, 182, '028', NULL, '2014-03-16', '黄昱彬（彬彬）', '女', '', NULL, 'B1', NULL),
	(786, 517, '2016-01-09', NULL, '2016-01-09 15:30:00', '2016-01-09 16:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小朋友非常的怕水，基本没上课。一直在岸边酝酿。', 1, '教学课程', NULL, NULL, 340, '2010', NULL, '2015-01-27', '赵屹琛', '女', '', NULL, 'A1', NULL),
	(788, 522, '2016-01-09', NULL, '2016-01-09 16:30:00', '2016-01-09 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '悠悠一开始下水是不开心的，第一次来对环境比较陌生，整节课运动量不大，但是慢慢对水适应了一些、', 1, '教学课程', NULL, NULL, 345, '1266', NULL, '2014-03-29', '悠悠', '男', '', NULL, 'A1', NULL),
	(789, 522, '2016-01-09', NULL, '2016-01-09 16:30:00', '2016-01-09 17:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '欧宝今天一开始爸爸带下水，非常的伤心，一直在哭，后来 妈妈下水后才好点，最后玩的比较=开心，拍水一脸都不怕。', 1, '教学课程', NULL, NULL, 174, '1124', NULL, '1899-12-31', '万益城', '男', '', NULL, 'B1', NULL),
	(791, 512, '2016-01-09', NULL, '2016-01-09 15:00:00', '2016-01-09 15:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '上课不认真只喜欢玩，喜欢跟教练对着干。腿打的不好。', 1, '教学课程', NULL, NULL, 342, '1265', NULL, '2011-01-01', '赵屹琛', '男', '', NULL, 'A1', NULL),
	(792, 527, '2016-01-09', NULL, '2016-01-09 17:00:00', '2016-01-09 17:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '小宇还是以往一样厉害，随便潜水都没问题。现在就是对他踢腿的练习规范加强。其他玩儿的基本都难不倒他。', 1, '教学课程', NULL, NULL, 173, '1123', NULL, '2013-12-31', '叶禹浩', '男', '', NULL, 'B2', NULL),
	(793, 527, '2016-01-09', NULL, '2016-01-09 17:00:00', '2016-01-09 17:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '媛媛很难控制，爸爸比较惯着，后来妈妈又下水换爸爸上去。勉强能够完成踢腿的动作，第一次来，看不出什么进步。', 1, '教学课程', NULL, NULL, 346, '1267', NULL, '2013-02-03', '龚韵然媛媛', '女', '象湖', NULL, 'B2', NULL),
	(794, 527, '2016-01-09', NULL, '2016-01-09 17:00:00', '2016-01-09 17:45:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '凯凯五岁了，以前都没接触过水，没有任何基础，有点难控制，学习能力还行。踢腿很快就学会了。', 1, '教学课程', NULL, NULL, 223, '1166', NULL, '2011-01-12', '凯凯', '男', '', NULL, 'C1', NULL),
	(795, 507, '2016-01-09', NULL, '2016-01-09 14:30:00', '2016-01-09 15:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '一一今天表现的很棒，很安静，潜了一次水，很有发展的空间。', 1, '教学课程', NULL, NULL, 216, '042', NULL, '2015-09-13', '夏霁然一一', '女', '保利', NULL, 'A1', NULL),
	(796, 507, '2016-01-09', NULL, '2016-01-09 14:30:00', '2016-01-09 15:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '皓皓今天表现有进步，做试水反应的时候比以前好，在保持这种状态很快就能潜水了。', 1, '教学课程', NULL, NULL, 277, '063', NULL, '2015-02-28', '章嘉皓', '男', '', NULL, 'A1', NULL),
	(798, 533, '2016-01-10', NULL, '2016-01-10 09:30:00', '2016-01-10 10:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '桐桐今天第一次来，还比较陌生，状态还不错，试水反应会闭嘴巴不哭闹。', 1, '教学课程', NULL, NULL, 351, '1271', NULL, '2015-06-30', '何予桐（桐桐）', '女', '', NULL, 'A2', NULL),
	(799, 543, '2016-01-10', NULL, '2016-01-10 10:30:00', '2016-01-10 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '太阳因为太久没来了不再状态，下水经常会哭闹。要让妈妈经常带太阳来。', 1, '教学课程', NULL, NULL, 180, '1129', NULL, '2013-12-31', '胡太阳', '男', '', NULL, 'A2', NULL),
	(800, 543, '2016-01-10', NULL, '2016-01-10 10:30:00', '2016-01-10 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '林林是今天表现最好的宝宝，不哭闹，试水反应很好。有潜水的潜质。', 1, '教学课程', NULL, NULL, 348, '070', NULL, '2014-07-03', '刘昌赣（林林）', '男', '', NULL, 'B1', NULL),
	(801, 543, '2016-01-10', NULL, '2016-01-10 10:30:00', '2016-01-10 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '诺诺一下水就哭，哭了一节课，环境太陌生没有安全感。', 1, '教学课程', NULL, NULL, 349, '1269', NULL, '2014-04-24', '刘诺一（诺诺）', '女', '高新', NULL, 'B1', NULL),
	(802, 543, '2016-01-10', NULL, '2016-01-10 10:30:00', '2016-01-10 11:00:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '帅帅今天刚上课的时候不愿意下水，容易哭闹，但是到快下课的时候，才慢慢进入状态，不过试水反应很好。', 1, '教学课程', NULL, NULL, 350, '1270', NULL, '2013-09-15', '杨嘉煜（帅帅）', '男', '', NULL, 'B2', NULL),
	(806, 554, '2016-01-10', NULL, '2016-01-10 11:20:00', '2016-01-10 12:20:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '牛牛现在的自由泳配合和上课的认真度还有待提高。', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(807, 554, '2016-01-10', NULL, '2016-01-10 11:20:00', '2016-01-10 12:20:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '乐乐上课经常在开小差，水感偏差，到目前为止还没有找到打腿的感觉。', 1, '教学课程', NULL, NULL, 200, '041', NULL, '2009-11-02', '朱思远', '男', '万科四季花城小区', NULL, 'C1', NULL),
	(809, 549, '2016-01-10', NULL, '2016-01-10 11:00:00', '2016-01-10 12:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '桐桐今天爸爸带下水，状态不错。潜水随便潜都没问题。试水反应浇水五秒没问题。吐泡泡还不错。踢腿意识还好。', 1, '教学课程', NULL, NULL, 175, '032', NULL, '2013-12-31', '余梓睿桐桐', '男', '', NULL, 'B2', NULL),
	(810, 549, '2016-01-10', NULL, '2016-01-10 11:00:00', '2016-01-10 12:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '黑猫警长今天进步也很大，试水反应也能够做到五秒钟，踢腿踢得不错，就是有点不认真，天赋还是有的。有很大进步空间。', 1, '教学课程', NULL, NULL, 281, '1214', NULL, '2012-12-21', '毛申辰', '男', '', NULL, 'C1', NULL),
	(812, 559, '2016-01-10', NULL, '2016-01-10 14:30:00', '2016-01-10 15:00:00', 10, 'Sunny', '王顺瀛', '15797780023', NULL, 'wsy18289534630', '150814', '满满今天表现很好，状态很嗨，很活跃，下水就笑的开心。踢腿根本停不下来。试水反应不错，潜水了两次，第一次面部入水完全没问题，第二次潜下去就喝水了。', 1, '教学课程', NULL, NULL, 185, '030', NULL, '2015-05-03', '何子聪', '男', '博泰滨江', NULL, 'A2', NULL),
	(813, 721, '2016-01-10', '', '2016-01-10 17:00:00', '2016-01-10 17:30:00', 12, 'MD', '张宋施奈', '18679171831', NULL, 'zssn751642458', '150814', '宝宝今天表现的很好，不会哭闹，试水反应表现的很淡定，坚持下去就能潜水了。', 1, '教学课程', NULL, NULL, 332, '1259', NULL, '2015-05-25', '邹昀宸（Wendy）', '女', '', NULL, 'A2', NULL),
