	(959, 519, '2016-01-23', NULL, '2016-01-23 15:30:00', '2016-01-23 16:00:00', 10, 'Sunny', '王顺瀛', '杨欢:13607061483', NULL, 'wsy18289534630', '150814', '彬彬今天还是蛮开心的，踢腿意识有一点了，我一直在后面嘱咐不踢腿就抓脚她就会慢慢的踢起来。不喜欢做试水反应，我从后门浇不到脸上，她会比较接受。', 1, '教学课程', NULL, NULL, 182, '028', NULL, '2014-03-16', '黄昱彬（彬彬）', '女', '', NULL, 'B1', NULL),
