	(961, 519, '2016-01-23', NULL, '2016-01-23 15:30:00', '2016-01-23 16:00:00', 10, 'Sunny', '王顺瀛', '晶晶:13698095705', NULL, 'wsy18289534630', '150814', '俊俊第一次来，表现的很好，他有一定的天赋，踢腿意识很好，试水反应也做的很好。妈妈带下水。', 1, '教学课程', NULL, NULL, 392, '1299', NULL, '2014-05-21', '魏凡竣', '男', '南昌市', NULL, 'A1', NULL),
	(962, 524, '2016-01-23', NULL, '2016-01-23 16:30:00', '2016-01-23 17:00:00', 10, 'Sunny', '王顺瀛', '李沙:18607006029', NULL, 'wsy18289534630', '150814', '皮特表现的不错，妈妈带下水，能够很好的完成试水反应，很喜欢笑。踢腿意识有一些，能够有很好的去吐泡泡的意识，妈妈有点担心他喝水，我说了这个是过程，没关系的。', 1, '教学课程', NULL, NULL, 91, '1053', NULL, '2014-09-10', '皮特', '男', '南昌市', NULL, 'B1', NULL),
	(963, 524, '2016-01-23', NULL, '2016-01-23 16:30:00', '2016-01-23 17:00:00', 10, 'Sunny', '王顺瀛', '小丑鱼:13699567736', NULL, 'wsy18289534630', '150814', '淘宝爸爸带下水，他很不喜欢躺着。踢腿意识不是很好，跳水能够完成，试水反应也能够完成。注意力还算集中。', 1, '教学课程', NULL, NULL, 117, '1076', NULL, '2014-02-16', '陶炫滋', '女', '南昌市', NULL, 'B1', NULL),
	(964, 524, '2016-01-23', NULL, '2016-01-23 16:30:00', '2016-01-23 17:00:00', 10, 'Sunny', '王顺瀛', '李峰:13517087411,妈妈:18970030523', NULL, 'wsy18289534630', '150814', '修齐踢腿意识有点差，注意力有些不集中，试水反应能够很好的完成，妈妈带下水，跳水坐着跳完成。', 1, '教学课程', NULL, NULL, 135, '044', NULL, '2015-01-06', '李修齐', '男', '南昌市', NULL, 'A2', NULL),
	(965, 504, '2016-01-23', NULL, '2016-01-23 11:10:00', '2016-01-23 12:10:00', 12, 'MD', '张宋施奈', '邹女士:15070005211', NULL, 'zssn751642458', '150814', '牛牛已经可以学仰泳了，但是自由泳还要在巩固一下', 1, '教学课程', NULL, NULL, 125, '022', NULL, '2009-07-04', '姚敏慎（牛牛）', '男', '南昌市八一桥', NULL, 'C1', NULL),
	(966, 504, '2016-01-23', NULL, '2016-01-23 11:10:00', '2016-01-23 12:10:00', 12, 'MD', '张宋施奈', '朱国辉:13870946936,杨建敏:15170002325', NULL, 'zssn751642458', '150814', '乐乐今天的进步很大，可以放掉板子大腿了，巩固一下就可以学划手了。', 1, '教学课程', NULL, NULL, 200, '041', NULL, '2009-11-02', '朱思远', '男', '万科四季花城小区', NULL, 'C1', NULL),
	(968, 514, '2016-01-23', NULL, '2016-01-23 15:00:00', '2016-01-23 15:30:00', 12, 'MD', '张宋施奈', '妈妈:186707083289,爸爸:13870857668', NULL, 'zssn751642458', '150814', '皓皓今天表现的不错，试水反应已经没有什么大问题了，下节课就能够潜水了。', 1, '教学课程', NULL, NULL, 277, '063', NULL, '2015-02-28', '章嘉皓', '男', '', NULL, 'A1', NULL),
	(969, 499, '2016-01-23', '', '2016-01-23 11:00:00', '2016-01-23 11:45:00', 11, 'James', '周建', '罗惟卉:18979171315', NULL, 'YL19931222', '150814', '妈妈带下水，派派今天表现一般，不怎么认真，心不在焉，打腿还好，试水也能自己给自己浇水，今天潜水了，效果不错。', 1, '教学课程', NULL, NULL, 222, '069-1', NULL, '2012-08-31', '侯清濯（派派）', '男', '', NULL, 'C1', NULL),
	(970, 722, '2016-01-23', '', '2016-01-23 11:30:00', '2016-01-23 12:15:00', 11, 'James', '周建', '略:18679163066', NULL, 'YL19931222', '150814', '妈妈带下水，小雨今天表现还好，打腿现在能直腿打了 ，试水也不错，还是很喜欢，今天跳潜了，表现很好。', 1, '教学课程', NULL, NULL, 173, '069', NULL, '2012-12-31', '叶禹浩', '男', '洪都北大道', NULL, 'B2', NULL);
